','','','','','','',100,'14',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(111,'other','',NULL,'Tere','O\'Connor','dummyemail@TereOConnor','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'31',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(112,'other','',NULL,'Kendra ','Portier','dummyemail@KendraPortier','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'31',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(113,'other','aceto@buffalo.edu',NULL,'Gus ','Giordano','dummyemail@c23b9eb91becc7d3d1588935de60db3283da147f616a10b2fb33d6d47c6119b976f42d1b','deceased','1923-07-10','2008-03-09','Choreographer,Dancer','','male','','','','','','','','','','Gus Giordano, an early and tireless popularizer of American jazz dance who organized the\r\nfirst Jazz Dance World Congress, died on March 9 in Chicago. He was 84.\r\nThe cause was pneumonia, according to his daughters, Nan and Amy Giordano.\r\nMr. Giordano was best known through the performing of his company, Giordano Jazz Dance\r\nChicago, founded in 1962 and based in Evanston, and through his teaching at dance\r\nconventions throughout the United States. The company, now directed by Nan Giordano, his\r\ndaughter, is said to have been the first dance troupe to dedicate itself solely to jazz dance.\r\nThe companyâ€™s programs featured pieces by Mr. Giordano and later, as he grew older,\r\nincluded dances by guest choreographers including Mia Michaels and Davis Robertson. The\r\nperformers became known for their strong training, energy and hard-driving, precise way of\r\nmoving.\r\nâ€œTheir sleek lines and high, silent jumps had the feel of a well-oiled 1958 Chevrolet Impala,\r\na pure expression of another era and something we remember as historically sexy,â€ Erika\r\nKinetz wrote in 2005 in The New York Times, reviewing â€œGiordano Moves,â€ a tribute\r\npresented at the 14th annual Jazz Dance World Congress in Chicago.\r\nMr. Giordano organized the first congress in 1990, bringing jazz dance companies together\r\nfor a week of master classes and performance in annual conventions held not only in the\r\nUnited States but also in countries including Japan, Germany and Mexico. He also wrote\r\nseveral books, including the 1975 â€œAnthology of American Jazz Dance,â€ published by Orion\r\n\r\nPublishing House in 1975, and â€œJazz Dance Class: Beginning Thru Advanced,â€ published by\r\nDance Horizons in 1992.\r\nHe was born in St. Louis and became interested in dance as a child. As a marine in World War\r\nII, he was assigned to perform in shows at military bases. He performed on Broadway after\r\nthe war in musicals including â€œPaint Your Wagonâ€ and â€œOn the Town.â€ He moved to Chicago\r\nin 1953. In 1980, he won an Emmy for the television special â€œThe Rehearsal.â€\r\nIn addition to his daughters Nan and Amy, he is survived by two sons, Patrick and Marc, and eight grandchildren, all in Chicago.','','',100,'65','','2021-12-07 13:22:09','2021-04-21 22:48:28','Boross, Bob. \"Bob Boross Freestyle Jazz Dance.\" Jazz Dance History. 1 Jan. 2010. Web. 12\nNov. 2014. <http://www.bobboross.com/page22/page61/page73/page73.html>.\nDunning, Jennifer. \"Gus Giordano, 84, Innovator Of Modern Jazz Dance.\" The New York\nTimes. The New York Times, 12 Mar. 2008. Web. 12 Nov. 2014.\n<http://www.nytimes.com/2008/03/13/arts/dance/13giordano.html?_r=1&>.\n\"Gus Giordano\". EncyclopÃ¦dia Britannica. EncyclopÃ¦dia Britannica Online.\nEncyclopÃ¦dia Britannica Inc., 2014. Web. 11 Nov. 2014\n<http://www.britannica.com/EBchecked/topic/1437196/Gus-Giordano>.','false'),(114,'other','',NULL,'Paul','Matteson','dummyemail@PaulMatteson','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'31',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(115,'other','',NULL,'Yvonne','Rainer','dummyemail@YvonneRainer','','0000-00-00','0000-00-00','','','','','','','','','','','','','