','','','','','','','','','','','','','',100,'65',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(144,'other','',NULL,'Victoria','DeChiazza','dummyemail@VictoriaDeChiazza','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'14',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(145,'other','',NULL,'Norman','Walker','dummyemail@NormanWalker','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'31',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(146,'other','',NULL,'Regina','Larkin','dummyemail@ReginaLarkin','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'31',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(147,'other','',NULL,'Nancy ','Lushington','dummyemail@NancyLushington','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'14',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(148,'other','',NULL,'Cherylyn','Lavagnino','dummyemail@CherylynLavagnino','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'14',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(149,'other','',NULL,'Mark','Haim','dummyemail@MarkHaim','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'31',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(150,'other','',NULL,'Jackie','Villamil','dummyemail@JackieVillamil','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'14',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(151,'other','aceto@buffalo.edu',NULL,'Gus','Solomons Jr.','dummyemail@e5fe19d0518fc9e41e6c4b14ec4737c1b76c6656b8ee7e8eb2f39c775060bd4c76a1eace','living','2020-01-01',NULL,'Actor,Choreographer,Dancer,Other','African American or Black','male','','Critic','','','','','United States of America','United States of America','','\"As an undergraduate in Architecture at the Massachusetts Institute of Technology Gus began modern dance training in Laban Technique with Jan Veen at the Boston Conservatory of Music and Graham Technique with Robert Cohan.  Upon graduation with his Bachelor of Architecture degree he decided to pursue dance in New York, where he performed as soloist in the companies of Donald McKayle, Joyce Trisler, Pearl Lang, Martha Graham, and Merce Cunningham, among others, before and after forming his own troupe, The Solomons Company/Dance, in 1972.Since then he has become a leading figure in postmodern, and experimental dance, creating over a hundred seventy dances for his own company, as well as dances commissioned by professional companies across North America, including the Alvin Ailey Repertory Ensemble in New York, The Berkshire Ballet, Contemporary Dance/Fort Worth, Spectrum Dance, Seattle, WA, and others, and numerous universities, including Cal State Long Beach, U.C. Santa Cruz, Manhattanv','upload/photo_upload_data/1639196962picture-blank.png','',100,'31','Experimental Dance','2021-12-10 23:29:37','2021-12-10 23:29:37','Gus filled out the excel form years ago. ','false'),(152,'other','aceto@buffalo.edu',NULL,'Carmen','de Lavallade','dummyemail@9ef10808baae9129a83a498a6d1dba1e0aebd5e7f86d229143c64ea18542de8f5a519467','living','1931-03-06',NULL,'Actor,Choreographer,Dancer','African American or Black','female','','','','','','','United States of America','United States of America','','Choreographer and dancer Carmen De Lavallade was born on March 6, 1931, to Grace Grenot and Leo Paul De Lavallade in Los Angeles, California. There, her aunt, Adele De Lavallade, owned the Hugh Gordon Book Shop, one of the first African American history bookshops on Central Avenue. Her cousin, Janet Collins, was the first African American prima ballerina at the Metropolitan Opera in New York City. De Lavallade discovered her talent for dance early. In 1945, she began studying ballet with Melissa Blake, and at the age of sixteen, upon graduation from Thomas Jefferson High School, she was awarded a scholarship to study dance with the renowned Lester Horton.\r\n\r\nIn 1949, De Lavallade became a member of the celebrated Lester Horton Dance Theater, where from 1950 to 1954, she enjoyed the status of lead dancer. During this time, De Lavallade continued to study dance, becoming proficient in ballet and other forms of modern and ethnic dance. Lester Horton insisted that she study other art forms, including painting, acting, music, set design and costuming. De Lavallade began studying ballet privately with Italian ballerina Carmelita Maracci and later acting with Stella Adler. In 1954, De Lavallade made her Broadway debut in House of Flowers, and that same year, Alvin Ailey, the founder of the Alvin Ailey American Dance Theater, moved to New York City to partner with her in that production.\r\n\r\nDuring that engagement in 1955, De Lavallade met and married dancer and actor Geoffrey Holder. With Holder, she completed her signature solo, Come Sunday, which he suggested choreographing to a black spiritual, sung by Odetta Gordon. In 1956, De Lavallade danced as the prima ballerina at the Metropolitan Opera performances of Samson and Delilah, and Aida. Also in 1956, she made her television debut in John Butler’s ballet Flight, and in 1957, she appeared in the television production of Duke Ellington\'s A Drum Is a Woman. In pursuit of an acting, Lena Horne introduced her to the executives at Twentieth Century Fox, and between 1952 and 1955, she appeared in several films, including Carmen Jones with Dorothy Dandridge. In 1959, she starred in Odds Against Tomorrow with Harry Belafonte. De Lavallade also appeared in several off-Broadway productions, including Othello and Death of a Salesman.\r\n\r\nBy the early 1960s, De Lavallade was a principal guest performer with Alvin Ailey’s company and on the company\'s first European tour in 1962, the billing was De Lavallade-Ailey American Dance Company. In 1964, she danced with Donald McKayle and in 1965 appeared in Agnes deMille’s American Ballet Theater productions of The Four Marys and The Frail Quarry. In 1970, De Lavallade joined the prestigious Yale School of Drama as a choreographer and performer-in-residence. She staged musicals, plays and operas, and later became a professor and member of the Yale Repertory Theater. Between 1990 and 1993, De Lavallade returned to the Metropolitan Opera as choreographer for Porgy and Bess and Die Meistersinger.\r\n\r\nIn 2004, De Lavallade received the Black History Month Lifetime Achievement Award, the Rosie Award and the Bessie Award in 2006.','upload/photo_upload_data/1637547280a.png','',100,'14,31','Ethnic Dance','2021-12-04 21:35:28','2021-12-04 21:35:28','Biography: https://www.thehistorymakers.org/biography/carmen-de-lavallade\n','false'),(153,'other','',NULL,'Cathleen','Sweeney','dummyemail@CathleenSweeney','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'31',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(154,'other','',NULL,'Cathy','McCann','dummyemail@CathyMcCann','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'31',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(155,'other','',NULL,'Carol','Skutek','dummyemail@CarolSkutek','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'14',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(156,'artist','d@preform.io',NULL,'David','Allen','d@preform.io','living','1980-05-12','0000-00-00',',Choreographer,Dancer,Musician,Visual_Artist,Other','Hispanic or Latino','other','Gender Queer','Digital Culture Worker','','Troy','','','United States of America','Puerto Rico','','david allen is a Hispanic-American digital culture worker whose art weaves threads of movement into experiential patterns using kinesthetic interfaces. As the design lead at CISL, allen collaborates with Students, Faculty, and Staff to both envision interactions with new interfaces, and to facilitate their development into plausible real-world applications. In culture work, allen performs under the pseudonym â€œdavid alokaâ€ in collaboration with dance companies, musicians, and theatrical groups to develop computational systems for live performance. With fine arts degrees from Pratt Institute and Rensselaer Polytechnic Institute, allenâ€™s work has been presented at AAAI, the Conference for Research on Choreographic Interfaces @ Brown, MIT Hacking Arts, Drexel University, Rutgers, and GameFest; and has been instantiated at the Tech Valley Center of Gravity, Illuminus Boston, and Illuminus on Lawn D.','upload/photo_upload_data/155751421020170425_dallen_profile_cl.jpg','',100,'7,12,22,1,67,75,78,92,114',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(157,'other','info@sinopolidances.org',NULL,'Ellen','Sinopoli','info@sinopolidances.org','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','http://sinopolidances.org/',100,'31',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(158,'other','chasingtherhythms@gmail.com',NULL,'Dr. Eddie Ade','Knowles','chasingtherhythms@gmail.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','https://www.facebook.com/EnsembleCongeros/',100,'7',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(159,'other','pampiamdas@gmail.com',NULL,'Aparna','Das','pampiamdas@gmail.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','http://indivinecompany.org/',100,'',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(160,'other','',NULL,'Johnny','Giraldo','dummyemail@JohnnyGiraldo','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','https://www.salsaycontrol.com/',100,'92',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(161,'other','mambokingon2@yahoo.com',NULL,'Eddie','Torres','mambokingon2@yahoo.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','http://www.eddietorresny.com/Eddie_Torres_NY/EddieTorresNY.com.html',100,'92',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(162,'other','info@islandtouchdance.com',NULL,'Jorge \"Ataca\"','Burgos','info@islandtouchdance.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','https://islandtouchdance.com/',100,'12',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(163,'other','info@islandtouchdance.com',NULL,'Tanja \"La Alemana\"','Kensinger','info@islandtouchdance.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','https://islandtouchdance.com/',100,'12',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(164,'other','aceto@buffalo.edu',NULL,'David','Parsons','dummyemail@b8bf3e2976cce435604a767489851e5867335306be45a639ba17a665a0de32cde65d0c28','living','1959-01-01','0000-00-00','','Caucasian or White','male','','','','','','','United States of America','','','\"David Parsons (Artistic Director/Founder has enjoyed a remarkable career as a performer, choreographer, teacher, director and producer of dance. Mr. Parsons was born in Chicago and raised in Kansas City. He was a leading dancer with The Paul Taylor Dance Company,where Mr. Taylor created many roles for him in works such as Arden Court, Last Look and Roses. He is a recipient of the 2000 Dance Magazine Award, as well as the 2001 American Choreography Award, for his work as a co-producer of AEROS, a production featuring the Romanian Gymnastic Federation that was featured on Bravo.\r\nMr. Parsons has created more than 70 works for Parsons Dance. He has received commissions over the years from The American Ballet Theatre, New York City Ballet, AlvinAiley American Dance Theater, the American Dance Festival, Jacobâ€™s Pillow, the Spoleto Festival and Het Muziektheater in Amsterdam, to name a few. His work has been performed by Paris Opera Ballet, Joffrey Ballet, Nederlands Danse Theatre, Nation','','https://ww