aa8a06e2e5a057fb62a7311acdfb','living','2020-01-01','0000-00-00','','Caucasian or White','female','','','','','','','United States of America','','','Guta Hedewig moved to New York City after dancing in Berlin and Dusseldorf and graduating from the School for New Dance Development in Amsterdam. Her work has been presented in New York City (Danspace Project, Dance Theater Workshop, PS122, La MaMa, Symphony Space, 92nd Street Y-Harkness Dance Center, Dancing in the Streets, Dixon Place, Long Island University, Movement Research at the Judson Church, and more), elsewhere in the United States (Jacob\'s Pillow, The Yard, Glenwood Springs, Philadelphia Fringe Festival), and internationally in Germany, Holland, Puerto Rico and Spain. As a dancer, she has been inspired by her work with Yoshiko Chuma, Pooh Kaye, David Dorfman, Nami Yamamoto, Jennifer Lacey, Wendell Beavers, Monica Bill Barnes and Thunder Bay Ensemble, among others. \r\nHedewig has been supported through Danspace Project by the Jerome Foundation and the New York State Council on the Arts, by the VIA Art Foundation, the Donald C. Ausman Family Foundation, Live Music for Dance/Ame','','',100,'31','','2020-10-10 14:35:04','2020-10-05 00:37:02',NULL,'false'),(212,'other','aceto@buffalo.edu',NULL,'Jean','Isaacs','dummyemail@e63e32491751e3563f50081e088cbd0f8b56657fb573bfb8119683292d53d9d2cb58f562','living','1994-01-01','0000-00-00','','','','','','','','','','United States of America','','','Jean Isaacs is a critically acclaimed, award-winning choreographer whose work has been presented in Switzerland, Germany, China, Mexico, Guatemala, Canada and Poland, as well as on both coasts of the US. In 2002, the Village Voice called her \"a warm, witty, and wise choreographer,\" and the New York Times said of her dances, \"They were intelligent dances danced by sharp, speedy dancers.\" Isaacs is the Artistic Director of the San Diego Dance Theater, the originator of the annual site-specific project Trolley Dances and the co-founder of the San Diego Dance Alliance, Three\'s Company and Dancers, and Isaacs/McCaleb & Dancers. Her work has been commissioned by the San Diego Opera, The La Jolla Playhouse, The Old Globe Theater, Goodman Theater, The San Diego Repertory Theater, the Berkeley Repertory Theater, Long Wharf Theater, and for the \"New Wave\" Festival at the Brooklyn Academy of Music.\r\n\r\nIsaacs collaborates frequently with numerous cross-border partners, creating the Festival of Mex','','http://www.sandiegodancetheater.org/',100,'31','  ','2020-10-05 00:58:44','2020-10-05 00:58:44',NULL,'false'),(213,'artist','neydacdim@gmail.com','neydacdim@gmail.com','Neyda','ColÃ³n-DiMaria ','neydacdim@gmail.com','living','2000-05-09','0000-00-00','Choreographer,Dancer,Poet','Hispanic or Latino','female','','','','Rochester','','','United States of America','United States of America','','','','',100,'4,7,12,14,22,30,31,42,53,117,65,75,92,93,104,113','','2021-03-17 22:11:53','2021-03-17 22:11:53',NULL,'false'),(214,'other','',NULL,'Christopher','Morrison','dummyemail@ChristopherMorrison','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'7,31',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(215,'other','',NULL,'Nydia ','Padilla-Rodriguez','dummyemail@NydiaPadilla-Rodriguez','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'7,31,1,92',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(217,'other','',NULL,'Monica','Barnes','dummyemail@MonicaBarnes','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','http://www.monicabillbarnes.com/',100,'31',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'true'),(220,'other','',NULL,'Gus','Solomons','dummyemail@GusSolomons','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',100,'31',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,'false'),(221,'other','',NULL,'Gwen','Welliver','dummyemail@GwenWelliver','','0000-00-00',