eto@buffalo.edu','','Whitney','Tucker','dummyemail@26b3b86c66f6a043beb5f8c9e0ce399d34c5aaa69d1b66948eee7fb752ee3321dc4e54d1','living','1982-01-01','0000-00-00','Choreographer,Dancer','Caucasian or White','female','','','','','','','United States of America','','','Whitney Rippelmeyer-Tucker, from the hills of southern Illinois, moved to New York in 2006 to pursue a career in modern dance.  She graduated Magna Cum Laude from Arizona State University with a BFA in Dance Education.  Her interests over time have led her to study Capoeira, Contact Improvisation, various lineages of yoga, boxing, and social dance.  She draws from experiences as a public school teacher (Vancouver, WA) and from those as the creator/facilitator of a movement-program for women who were recovering from prostitution (Phoenix, AZ).  She is a member of David Dorfman Dance and Tiffany Mills Company, is a teacher-trainer at the Kane School of Core Integration,  and is completing certification as a Birth Doula.  Most-recently, she became co-founder of Studio 26, a wellness-center located in Manhattan.													','upload/photo_upload_data/1594519190Screen Shot 2020-07-11 at 10.00.26 PM.png','',100,'31','      ','2020-07-11 21:59:57','2020-07-11 21:57:41',NULL,'false'),(519,'other','dummyhiddenemail',NULL,'Mark','Hull','dummyemail@0df8711ebd70b9abfea946970a8bf8bfa4534a49935a7e6a02f67488304fa2eded3a408a','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(520,'other','dummyhiddenemail',NULL,'David','Dorfman','dummyemail@7d433e49fd6a0d416b2fd7ad58080165b0105207326382ebb441c96a6160fb715a891e1d','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'31',NULL,NULL,NULL,NULL,'false'),(521,'other','dummyhiddenemail',NULL,'Jennifer','Tsukayama','dummyemail@6a93a9e2b5987e5137565ba6dce2e50bf8e87b5b8312d80bcdce69d4f26281d88afa0b72','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'f