il',NULL,'Cathy','Ward','dummyemail@a439cb508f3a33c10fd21ae151e8ed6c6db87d87f4d639bee8c6bfbf401d808f8d9f56fe','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'31',NULL,NULL,NULL,NULL,'false'),(574,'other','dummyhiddenemail',NULL,'Jesse','Durenceau','dummyemail@b7b56cac96065129ed49864c2d0ab9516896847d499909796ffb014902b455da094d5373','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'31',NULL,NULL,NULL,NULL,'false'),(575,'other','dummyhiddenemail',NULL,'Eugene Louis Luigi','Facciuto aka Luigi','dummyemail@5989339c6322c0688d950399d92e2b7cf2052cdf42cf9fd5464a729af6c4a71e7901949f','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'65',NULL,NULL,NULL,NULL,'false'),(576,'other','aceto@buffalo.edu',NULL,'Matt','Mattox','dummyemail@69455406b17cd423ae9572760172bfc3326ca56db6a520d709475ba90fac9743d22e45a0','deceased','1921-08-18','2013-02-18','','Caucasian or White','male','','','','','','','','','','Matt Mattox was born on August 18, 2013 in Tulsa, Oklahoma. He started his dance training\r\nat the age of 11. He began his training in ballet studying with Ernest Belcher, Nico Charisse,\r\nand Eugene Loring. He also studied tap with Willie Covan and Louis Dapron. In 1944, he was\r\nimmediately contracted by MGM. He focused on the classical form of dance before\r\nauditioning for Jack Cole at the age of 28, which lead him to be more driven in the Jazz\r\ndance form. Some broadway shows he initially stared in are \"Magdalena,\" \"Alive and\r\nKicking,\" and \"Ziegfeld Follies.\" He also went full force into film industry staring in\r\n\"Gentlemen Prefer Blondes,\" \"The \"I Don\'t Care\" Girl,\" and \"Seven Brides for Seven Brothers.\"\r\nIn 1956, he opened up his own studio in New York while continuing to perform. He also\r\nstarted his own company in 1961 to train dancers in his Mattox freestyle dance. In 1964, he\r\nreceived the Dance Master\'s of America award and closed his school to become the Artistic\r\nDirector of New Jersey Ballet. He eventually retired from performing but continued to\r\nchoreograph for the stage and film industry. In 1970, he moved to London to teach at the\r\nLondon Dance Centre and appear with his JazzArt group. In 1975, he relocated to Paris to\r\nfind more JazzArt dancers and ended up settling in Perpignan. In 1981, he opened the Ecole\r\nde Dance where he continued to work until he passed away on February 18, 2013.','','',100,'65','','2021-06-16 12:44:03','2020-10-27 20:48:07',NULL,'false'),(577,'other','dummyemail@GusGiordano',NULL,'Phil','Wackerfuss','dummyemail@GusGiordano','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'65',NULL,NULL,NULL,NULL,'true'),(578,'other','dummyemail@GusGiordano',NULL,'Ron','Lewis','dummyemail@GusGiordano','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'65',NULL,NULL,NULL,NULL,'false'),(579,'other','dummyemail@GusGiordano',NULL,'Jack','Cole','dummyemail@GusGiordano','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'65',NULL,NULL,NULL,NULL,'false'),(580,'other','dummyemail@GusGiordano',NULL,'Ronn','Forella','dummyemail@GusGiordano','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'65',NULL,NULL,NULL,NULL,'false'),(581,'other','dummyemail@GusGiordano',NULL,'Jo Jo','Smith','dummyemail@GusGiordano','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'65',NULL,NULL,NULL,NULL,'false'),(582,'other','dummyemail@GusGiordano',NULL,'Ann Marie','Garvin','dummyemail@GusGiordano','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'65',NULL,NULL,NULL,NULL,'false'),(583,'other','tpralabate@gmail.com',NULL,'Rhett','Dennis','dummyemail@2d092a38d1b021107d6ea47448344de62637dcb3babf66fab53c1780c605415f5475a817','deceased','1931-07-07','2017-01-27','Choreographer,Dancer','','','','','','','','','','','','','','',25,'65','','2021-02-12 07:58:16',NULL,NULL,'false')