'Caucasian or White','female','','instructional designer','','Clarence Center','NY','','United States of America','','','Roberta (Robin) Sullivan, Teaching and Learning Strategist, Educational Services Team, University Libraries, State University of New York at Buffalo. Ms. Sullivan conducts research regarding innovative digital pedagogy and assists students, faculty, and other stakeholders to explore and implement established and emerging technologies to support teaching and learning. Among her many contributions, she has also served as an adjunct professor for various departments and schools within UB. She is the Director of the SUNY Exploring Emerging Technologies for Lifelong Learning and Success (#EmTechMOOC) http://suny.edu/emtech . EmTech is an open-access resource delivered as a Coursera-based MOOC to help participants identify the value and implications of using established and emerging technology tools for personal and professional growth and to acquire lifelong learning strategies to keep pace with technology change. She is the PI of the Tools of Engagement Project (TOEP) http://suny.edu/toep ','upload/photo_upload_data/1601229845Roberta Robin Sullivan Profile.jpg','',100,'','  ','2020-09-27 14:19:27','2020-09-27 14:19:27',NULL,'false'),(755,'other','tony@rozak.com',NULL,'Anthony','Rozak','tony@rozak.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','https://www.linkedin.com/in/anthony-rozak-68b95125/',0,'',NULL,NULL,NULL,NULL,'false'),(756,'other','gradel@fredonia.edu',NULL,'Kathleen','Gradel','gradel@fredonia.edu','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','https://www.fredonia.edu/academics/colleges-schools/college-education/coe/education-department/facul',0,'',NULL,NULL,NULL,NULL,'false'),(757,'other','cvanp@binghamton.edu',NULL,'Cherie','van Putten','cvanp@binghamton.edu','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','https://www.binghamton.edu/clt/ids/contact.html',0,'',N