Battleworks, she also served as the Company Manager, and assistant to Mr. Battle.  Ms. Clark assisted Mr. Battle with several commissions, uncluding â€œJubaâ€ and â€œLove Storiesâ€ for the Alvin ','','',100,'','  ','2020-10-01 23:47:34','2020-10-01 23:47:34',NULL,'false'),(785,'other','carolynadamskahn@gmail.com',NULL,'Carolyn','Adams','carolynadamskahn@gmail.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(786,'other','carolynadamskahn@gmail.com',NULL,'Eric','Hampton','carolynadamskahn@gmail.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(787,'other','carolynadamskahn@gmail.com',NULL,'Benjamin','Harkarvy','carolynadamskahn@gmail.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(788,'other','carolynadamskahn@gmail.com',NULL,'Michelle','Lees','carolynadamskahn@gmail.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','marylandyouthballet.org',0,'',NULL,NULL,NULL,NULL,'false'),(789,'other','carolynadamskahn@gmail.com',NULL,'Linda','Kent','carolynadamskahn@gmail.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(790,'other','carolynadamskahn@gmail.com',NULL,'Robert','Battle','carolynadamskahn@gmail.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(791,'other','lubovitch@aol.com',NULL,'Lar','Lubovitch','lubovitch@aol.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','lubovitch.org',0,'',NULL,NULL,NULL,NULL,'false'),(792,'other','aceto@buffalo.edu',NULL,'Mark','Morris','dummyemail@dd3e3fcbcef4782fe350a56da694b2345960c435259c0612ee03de7f3ed01d0c61949b69','living','1956-08-29',NULL,'Choreographer,Dancer,Other','Prefer not to answer','male','','Director','','','NY','','United States of America','United States of America','','Mark Morris, (born August 29, 1956, Seattle, Washington, U.S.), American dancer and choreographer who formed his own modern dance company, the Mark Morris Dance Group. He was noted for his innovative and, at times, controversial works.\r\n\r\nAt age eight, after attending a performance by the José Greco flamenco company, Morris decided to become a Spanish dancer. He took classes and at age 11 began performing professionally. Two years later he joined the Koleda Folk Ensemble and at age 14 began choreographing professionally. Morris spent part of 1974 studying in Spain and in 1976 moved to New York City, where he danced in the companies of such choreographers as Eliot Feld, Lar Lubovitch, Laura Dean, and Hannah Kahn. In 1980 he launched his company when he and 10 fellow dancers presented a concert of his works, and its reputation was solidified at the Brooklyn Academy of Music’s 1984 Next Wave Festival. Two years later Morris won a Guggenheim fellowship, was choreographing for major ballet companies, and began taking his company on tour. Many, however, did not understand his outrageous humour or his more creative works, and he soon earned a reputation as “the bad boy of modern dance.”\r\n\r\nIn 1988 Morris became the resident choreographer of the Théâtre Royal de la Monnaie in Brussels, and he expanded the membership of his company and renamed it the Monnaie Dance Group/Mark Morris. During his three years in Belgium, Morris choreographed some of his most acclaimed and enduring creations, including L’Allegro, il penseroso ed il moderato (1988), his first full-evening work and the subject of a photo and essay book (2001); Dido and Aeneas (1989), a dance version of the opera, in which Morris danced the parts of both Dido and the Sorceress; and The Hard Nut (1991), his version of The Nutcracker. While Morris was out of the United States, Mikhail Baryshnikov and the White Oak Dance Project kept Morris’s works before the American public.\r\nFollowing the company’s return to the United States in 1991, Morris created an average of five or six new works each year for his company—including Beautiful Day (1992), The Office (1994), Somebody’s Coming to See Me Tonight (1995), and Four Saints in Three Acts (2000), his version of the Gertrude Stein–Virgil Thomson opera—and by 2001 had choreographed more than 100 numbers. Noted for his musicality, he created classical ballets for numerous companies, including the American Ballet Theatre, the San Francisco Ballet, and Les Grands Ballets Canadiens. By the turn of the 21st century, the onetime enfant terrible of modern dance had become a setter of standards and a solid member of the dance establishment. In 2001 the Mark Morris Dance Center in Brooklyn, New York, opened as the troupe’s first permanent home in the United States.\r\nMorris’s memoir, Out Loud (written with Wesley Stace), was published in 2019.','upload/photo_upload_data/1638671700picture-blank.png','mmdg.org',100,'13,14,31,42','','2021-12-04 22:02:08','2021-12-04 22:02:08','Biography: https://www.britannica.com/biography/Mark-Morris\nArtist Lineage: https://en.wikipedia.org/wiki/Mark_Morris_(choreographer)','false'),(793,'other','carolynadamskahn@gmail.com',NULL,'Igal','Perry','carolynadamskahn@gmail.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','Peridance.com',0,'',NULL,NULL,NULL,NULL,'false'),(794,'artist','eks10@stmarys-ca.edu','','Eesha','Shah','eks10@stmarys-ca.edu','living','1999-08-17','0000-00-00','Choreographer,Dancer','Asian','female','','','','Piedmont','','','United States of America','','','I was born in Oakland, California, on August 17, 1999. I have an older sister named Krishna. My parents were born in India and immigrated to United States.','upload/photo_upload_data/160254281902EE9F3E-E471-4F13-B922-DDBA6437AD65.jpeg','',100,'14,31,58','','2020-10-12 18:49:36','2020-10-12 18:49:36',NULL,'false'),(795,'other','dummyhiddenemail',NULL,'AudreÃ©','Estey','dummyemail@af4f530