ack Cole, Viola','','',100,'31','','2020-10-08 14:53:23','2020-10-04 17:51:37','','false'),(859,'other','dummyhiddenemail',NULL,'Don','Halquist','dummyemail@7230c01a26e51dcf2fa33a4f2785e903c484059cf8fea1fe838fcc87a3ee8dc1c8d7d0c6','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(860,'other','dummyhiddenemail',NULL,'Debra','Knapp','dummyemail@5674c159510af9f725ccd346128d04a08100e8ce65fd110cc5d2487ed0dd757944a43cf0','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(861,'other','dummyhiddenemail',NULL,'Gregg','Lizenbery','dummyemail@e5442b50a81e98d42c9ce1c52bdd8983b1b5527da8af54df6d3fde5489c9f9384b52bf7d','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(862,'other','dummyhiddenemail',NULL,'Debbie','Poulsen','dummyemail@3e48376a8f426809f4d5ce4cebb89310bf26aa31b6a768a2f422616a47b0985b9afd1166','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(863,'other','dummyhiddenemail',NULL,'Shirley','Jenkins','dummyemail@1cb649fc62b93fba7d92d089f652c5efb29bea47fd1108b8dd1535bb4abf8871c70cf9a3','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(864,'other','dummyhiddenemail',NULL,'Linda','Johnson-Gallegos','dummyemail@6b19ce5fdc6324e5ae0736355a14f087266899611d3b5992ab88ddc6a82b838641ab89ae','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(865,'other','dummyhiddenemail',NULL,'Sara','Hutchinson','dummyemail@c266ba502906b1b5a188f3e5b113c04de4ae03011ef6b86b3e02109208978972f4998a5b','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(866,'other','dummyhiddenemail',NULL,'Mark','Yonelly','dummyemail@07ad12081167c5383553c6722393838d885501a42c9edd4ebd12532ad92d10928f8e8805','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(867,'other','aceto@buffalo.edu',NULL,'Donald','McKayle','dummyemail@563465a509853d12034cb8deca156e6bd68a1be11a61d77dfd2c36d13f08c37630e6a292','deceased','1930-07-06','2018-04-06','Choreographer,Dancer,Other','Prefer not to answer','male','','Director, Writer','','','','New York','','United States of America','','Choreographer and educator Donald McKayle was born on July 6, 1930 in New York City, New York to Eva Wilhelmina Cohen McKayle and Philip Augustus McKayle. Inspired by a Pearl Primus performance, he began dancing his senior year in high school, and won a scholarship to the New Dance Group in 1947.\r\n\r\nIn 1948, McKayle choreographed his first piece of work with the New Dance Group, and premiered his solo piece, Saturday\'s Child. From 1951 to 1969, McKayle founded and directed his own dance company, Donald McKayle and Company, which premiered his first major work entitled Games in 1951. McKayle then went on to choreograph masterworks Rainbow \'Round My Shoulder, District Storyville and Songs of the Disinherited. Golden Boy (1964) was his first Broadway production, followed by I\'m Solomon (1969) and Dr. Jazz (1975). McKayle directed and choreographed Raisin (1974), which was awarded a Tony for best musical. He was responsible for the entire concept, staging and choreography of the award-winning Sophisticated Ladies (1981). McKayle has also choreographed for films, including Bedknobs and Broomsticks (1970), The Great White Hope (1972), and The Minstrel Man (1976). McKayle has also choreographed stage acts for singers such as Harry Belafonte and Rita Moreno. In 2001, he choreographed the monumental ten-hour production of Tantalus.\r\n\r\nThe repositories for McKayle’s work include the Alvin Ailey American Dance Theatre, the Cleveland San Jose Ballet, and the Los Angeles Contemporary Dance Theatre. He served as head of the Inner City Repertory Dance Company from 1970 to 1974, and then as choreographer for the Limon Dance Company since 1995. In all, McKayle choreographed over ninety performances for dance companies in the U.S., Canada, Israel, Europe and South America. He has taught at Bennington College, the Juilliard School, the American Dance Festival, and in Europe. McKayle served as dean of the School of Dance at the California Institute of the Arts, and as professor of dance and the artistic director for the University of California, Irvine Dance.\r\n\r\nMcKayle has received numerous honors and awards, including an Outer Critics Circle Award, a NAACP Image Award, the Capezio Award, the Samuel H. Scripps/American Dance Festival Award,  the American Dance Guild Award, a Living Legend Award from the National Black Arts Festival, two Choreographer’s Fellowships from the National Endowment for the Arts, the Dance/USA Honors, the Martha Hill Lifetime Achievement Award, the Annual Award from the Dance Masters of America, the Lifetime Achievement Award from the Dance Under the Stars Choreography Festival, the Black College Dance Exchange Honors, the Dance Magazine Award, and the American Dance Legacy Institute’s Distinguished and Innovative Leadership Award, among others. In 2005, McKayle was honored at the John F. Kennedy Center in Washington, D.C. and presented with a medal as a Master of African American Choreography. He has been named by the Dance Heritage Coalition as \"one of America’s Irreplaceable Dance Treasures: the first 100.\"','upload/photo_upload_data/1637542593a.png','',100,'7,14,31,52,104','Hindu','2021-11-21 21:05:11','2021-11-21 21:05:11','Biography: https://www.thehistorymakers.org/biography/donald-mckayle\nDetails of Lineal Artist: https://www.thirteen.org/freetodance/biographies/mckayle.html\n                                     https://en.wikipedia.org/wiki/Donald_McKayle','false'),(868,'other','dummyhiddenemail',NULL,'Viola','Farber','dummyemail@c32c03aa5eb338c94d1d480d9c81e77b2199e48fcc49c76ac360cd7713f6ee