'0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(905,'other','namiyamamoto@earthlink.net',NULL,'Nami','Yamamoto','namiyamamoto@earthlink.net','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(906,'other','aceto@buffalo.edu','','Doris','Humphrey','dummyemail@01bac36133ea783abac4de6e06f8b9300277268f32d45145578c523ca3b26addb7e4c7d9','living','1895-10-17','0000-00-00','','Caucasian or White','female','','','','','','','United States of America','','','\"Doris Humphrey was born in Oak Park on October 17, 1895. Her father, Horace Buckingham Humphrey, was a journalist and one-time hotel manager. Her mother, Julia Ellen Wells, was a trained concert pianist. Through both her parents, Doris was a tenth generation American. Her mother\'s ancestors had come from England to Boston in 1636. Her father was a descendent of the famous William Brewster who had arrived on the Mayflower in 1620. Humphrey Avenue in Oak Park is named for her paternal grandfather, the Reverend Simon James Humphrey, who settled in the village in 1867. Another village street, Elizabeth Court is named for his second wife Elizabeth Emerson Humphrey.\r\n\r\nA slim, graceful child, Doris Humphrey showed inclination for dance at an early age. Her mother encouraged her and arranged for lessons with eminent ballet masters. However, her real inspiration came from Mary Wood Hinman, who taught dance at the school she attended from kindergarten through high school, the Francis Parker Sc','','',100,'','','2020-10-08 14:53:39','2020-10-05 00:51:31','','false'),(907,'other','dummyhiddenemail',NULL,'Mary','Wood Hinman','dummyemail@2197dc536ffd0078fa3c21656ab044207fa235d80909bba60c93b3e171965069af07a93b','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(908,'other','aceto@buffalo.edu',NULL,'Ruth','St. Denis','dummyemail@9d3030c52c109a8b774e2dfd25c5abb98f9c116c0d01a059669267e2ee5bfb53056062fe','deceased','1877-01-20','1968-07-21','','','female','','','','','','','','','','Raised in a Bohemian environment, Ruth St. Denis (1879-1968) was encouraged to perform\r\nas a youngster. She studied ballroom and skirt dancing at the Maud Davenport school in\r\nSomerville, New Jersey, and was drilled in Delsarte poses by her mother. Her first\r\nprofessional job was as a variety act in 1894 at Worth\'s Family Theatre and Museum in New\r\nYork. Important early influences were her work with the eminent director David Belasco,\r\neastern spiritualism and imagery, along with European travel. By 1906 with Radha, St. Denis\r\nhad the essence of her distinctive dance style, which combined spiral form with equal parts\r\nvoluptuousness, mysticism, and erotica. She built a stunning career as a soloist and, in 1914,\r\nacquired a professional and personal partner in Ted Shawn. A year later the two opened\r\nDenishawn which, as a school and company, nurtured leaders of the next generation of\r\nmodern dancers: Martha Graham, Doris Humphrey, and Charles Weidman. As a\r\nchoreographer, St. Denis created some beautiful visualization group works, but her\r\nperformance in such solos as The Incense, The Nautch, The Cobras, The Yogi, Liebestraum,\r\nand, with Shawn, in Tillers of the Soil are most memorable. Her autobiography, An\r\nUnfinished Life, was published in 1939.','','',100,'','','2020-10-27 21:44:58','2020-10-27 21:44:58',NULL,'false'),(909,'other','dummyemail@686980bcfb41002b02b52b05de2124b8e3b888c',NULL,'Charles','Weidman','dummyemail@686980bcfb41002b02b52b05de2124b8e3b888c488d48a777638de88d13a84cf16ff6c2a','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(910,'other','dummyemail@686980bcfb41002b02b52b05de2124b8e3b888c',NULL,'Pauline','Lawrence','dummyemail@686980bcfb41002b02b52b05de2124b8e3b888c488d48a777638de88d13a84cf16ff6c2a','','0000-00-00','0000-00-00','','','','','','','','','',