b0ffa2990832f271d','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'31',NULL,NULL,NULL,NULL,'false'),(926,'other','dummyhiddenemail',NULL,'Wilfride','Piollet','dummyemail@e6e5c9be375a8d72d14e410e551f33ef8aa88040d53ecac0529080b0bf1303fc17a5ebfc','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'31',NULL,NULL,NULL,NULL,'false'),(927,'other','dummyhiddenemail',NULL,'Edward','Villella','dummyemail@ddf0edf6791e371015af458be52f70d3799934e6774630aa538b3bb2032bad680241ee64','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'14',NULL,NULL,NULL,NULL,'false'),(928,'other','aceto@buffalo.edu',NULL,'George','Balanchine','dummyemail@3b891cbfcbdc6fcd4b558aa67143af97954cfe0b98747d0c3ba0c934e5aa5729992bdcc4','deceased','1904-01-22','1983-04-30','','Caucasian or White','male','','','','','','','','','','George Balanchine was born in St. Petersburg, Russia in 1904. Before he began his dance\r\ntraining, he studied piano as his father was a composer. This helped him gain knowledge of\r\nmusic early in life that far exceeded that of most of his fellow choreographers. At the age of\r\nnine, he entered the Imperial Ballet School, performing in shows at the Maryinsky Theater\r\nsuch as The Sleeping Beauty. After graduating from the school with honors, he joined the\r\ncorps de ballet of this theater, which was re-named the State Theater of Opera and\r\nBallet. While he was in France, Serge Diaghilev saw him dance and asked him to join his\r\ncompany, the well-known Ballet Russes. Diaghilev had his eye on Balanchine as a\r\nchoreographer as well as a dancer, and after choreographer Bronislava Nijinska left the\r\ncompany, Balanchine took her place as Ballet master. From this time until Diaghilevâ€™s death\r\nand the collapse of the Russes, he choreographed numerous works, most notably Apollo\r\n(1928) and The Prodigal Son (1929). After this company vanished, he created works for the\r\nnew Ballet Russes de Monte Carlo such as Cotillon, La Concurrence, and Le Bourgeois\r\nGentilhomme. In 1933, he fulfilled his dream of making his own company, Les Ballets. Soon\r\nafter, a man by the name of Lincoln Kirstein (1907-1996) found Balanchine and asked him\r\nto come to America and form his company there. He agreed, but he first formed a school in\r\nNew York City â€“ The School of American Ballet. From 1934 to today, this school trains\r\ndancers for a professional career in Ballet. Balanchineâ€™s first work on the students of the\r\nschool, Serenade, showed an astounding connection that he could create between the\r\nmovement and the music. He was known for putting great importance on musicality,\r\nbalance, control, precision, and ease of movement, as seen in most of his works. In 1935,\r\nKirstein and Balanchine presented their ballet company, The American Ballet, for the first\r\ntime. The Metropolitan Opera House asked Balanchine to have the company be the resident\r\nballet company. However, he only had two solely-dance concerts in his time there. During\r\n\r\nthis time at the MET, he created a concert solely using music from composer Igor\r\nStravinsky. This first collaboration of these two artists would lead to many more, as both of\r\nthe artists were inspired by each other. During this period of time, Balanchine also\r\nchoreographed for Broadway and film, producing such works as Slaughter on Tenth Avenue,\r\nOn Your Toes (1936), Ziegfeld Follies (1936), I Married an Angel (1938), The Merry Widow\r\n(1943), and more. In 1941, he and Kirstein had assembled another ballet company called\r\nBallet Caravan, in which Balanchine choreographed Concerto Barocco and Ballet Imperial\r\n(later renamed Tchaikovsky Piano Concerto No. 2). 1946 was the year that is the most\r\nimportant in history, as Balanchine and Kirstein collaborated to form Ballet Society, which\r\nwould be named the New York City Ballet in 1948. New works included The Four\r\nTemperaments (1946) and Stravinskyâ€™s Renard (1947) and Orpheus (1948). After the\r\ncompany was renamed the New York City Ballet, Balanchineâ€™s work had â€œfound a permanent\r\nhome.â€ He was the artistic director and principal choreographer of the company until his\r\ndeath, and created approximately 175 works for this company. His most famous works\r\ninclude The Firebird (1949), La Valse (1951), The Nutcracker (his first full length work for\r\nthe company), Ivesiana and Western Symphony (1954), Allegro Brillante (1956), Agon (1957),\r\nSeven Deadly Sins (a revival of the original Les Ballets 1933 production), Stars and Stripes\r\n(1958), A Midsummer Nightâ€™s Dream (1962), Jewels (1967) (his first full-length plotless\r\nballet) and Who Cares? (1970). Even in his narrative ballets, Balanchine always focused on\r\nthe importance of the movement in relation to the music. In January 1978, the New York\r\nCity Ballet participated in the acclaimed PBS series â€œLive from Lincoln Cente','','',100,'14','','2020-10-27 21:20:02','2020-10-27 21:20:02',NULL,'false'),(929,'other','dummyhiddenemail',NULL,'Kenneth','King','dummyemail@939c7d0ff22043f4917149020858164f14834e77801a5f8358a340033d49ef0764738a6a','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'31',NULL,NULL,NULL,NULL,'false'),(930,'other','dummyhiddenemail',NULL,'Rudolph','Nureyev','dummyemail@5fff1eb33254e19898091a07dd76182341479e16d1840d6e8c85bdf2c5742fb09b419c25','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'14',NULL,NULL,NULL,NULL,'false'),(931,'other','dummyhiddenemail',NULL,'James','Truitt','dummyemail@901e20d82a0e2340b3aee3de79794a7432d94c6b14c0bf9d0b21a36b996d37914fd6a613','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'31',NULL,NULL,NULL,NULL,'false'),(932,'other','dummyhiddenemail',NULL,'Barbara','Roan','dummyemail@e221353eb8da1eba06ca470201359bfbaa2189e930b680518d4350b2dc0db6eb022f4c43','','0000-00-00','0000-00-00','','','','','','','','','','',''