0-00','Choreographer,Dancer,Filmmaker,Other','Caucasian or White','female','','Board Certified Massage Therapist and Jin Shin Jyutsu Practitioner','','Milford','CT','','United States of America','','','Currently listed on A Growing List of Active Women Choreographers  in Dance Magazine, Mitzi Adams has been choreographing for over three decades.  She received her B. F. A. in dance from Temple University and her M. F. A. in dance at the University of Arizona. She has toured with several modern dance companies, including The Douglas Nielsen Dance Company, Tenth Street DanceWorks, Orts Dance Theater, a European tour with the Dalton/Hartel Dance Company, where she worked with the now famed cultural icon, Jin Xing, and in Connecticut with Bernier Dance and Mary Barnett/In Good Company. She has worked with many independent choreographers, including Mark Dendy, Albert Reid, Sam Watson, and Madeleine Scott. Her company, Adams Company Dance, has presented her choreography in California, Michigan, Arizona, Philadelphia, Connecticut and, in New York City, at The Ailey CitiGroup Theater; Martin Luther King Jr. High School; DanceSpace; Dance New Amsterdam; Theatre of the Riverside Church; Merce C','upload/photo_upload_data/1602259717Mitzi Headshot 2018 (2+).jpg','',75,'14,30,31,117,65','','2020-10-09 12:08:59',NULL,NULL,'false'),(942,'other','aceto@buffalo.edu','','Helen','Picket','dummyemail@bb14a5132eafd8a1c76324dfa2d0b4ef45912d02c433a18439a38a668f1903198a20b768','living','1967-01-01','0000-00-00','','Caucasian or White','female','','','','','','','United States of America','','','Helen Pickett studied dance at The San Francisco Ballet School. While in school, she performed with San Francisco Ballet Company under the direction of Michael Smuin and Lew Christensen, and later, Helgi Tomasson. \r\nFor over a decade Helen danced and acted with Ballet Frankfurt, dir., William Forsythe. Upon retiring, Helen performed with The Wooster Group, dir. Elizabeth Le Compte, from 1998-2005. She was in the original cast of the OBIE award winning House/Lights. From 2005 to 2008, Helen revisited one of her favorite roles, Agnes, as a guest artist in William Forsytheâ€™s Impressing the Czar with The Royal Ballet of Flanders. In London, at the Sadlerâ€™s Wells Theatre, The Royal Ballet of Flanders was awarded the Laurence Olivier Award, 2008, for Impressing the Czar. In 2005, Mikko Nissinen, director of The Boston Ballet, offered Helen her first choreographic commission, Etesian. She was awarded a Fellowship Initiative Grant from The New York Choreographic Institute in September 2006','','',100,'','','2020-10-09 18:26:24','2020-10-09 18:26:24',NULL,'false'),(943,'other','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a90',NULL,'Kathryn','Irey','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a901efaca472164e8be56917520ae9e08b04','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(944,'other','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a90',NULL,'Thomas','DeFrantz','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a901efaca472164e8be56917520ae9e08b04','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(945,'other','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a90',NULL,'Larisa','Skylenskaya','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a901efaca472164e8be56917520ae9e08b04','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(946,'other','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a90',NULL,'Anatole','Vilsak','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a901efaca472164e8be56917520ae9e08b04','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(947,'other','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a90',NULL,'Nicole','Sowinska','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a901efaca472164e8be56917520ae9e08b04','','0000-