wers and Jamaica. \r\n\r\nIn 1958, he founded Alvin Ailey American Dance Theater to carry out his vision of a company dedicated to enriching the American modern dance heritage and preserving the uniqueness of the African-American cultural experience. He established the Alvin Ailey American Dance Center (now The Ailey School) in 1969 and formed the Alvin Ailey Repertory Ensemble (now Ailey II) in 1974. Mr. Ailey was a pioneer of programs promoting arts in education, particularly those benefiting underserved communities. Throughout his lifetime, he was awarded numerous distinctions, including the Kennedy Center Honor in 1988 in recognition of his extraordinary contribution to American culture. In 2014, he posthumously received the Presidential Medal of Freedom, the countryâ€™s highest civilian honor, in recognition of his contributions and commitment to civil rights and dance in America.  When Mr. Ailey died on December 1, 1989, The New York Times said of him, â€œyou didnâ€™t need to have known [him] personally to have been touched by his humanity, enthusiasm, and exuberance and his courageous stand for multi-racial brotherhood.â€','','',75,'31','','2021-08-10 14:02:12',NULL,'Bio:  https://www.alvinailey.org/alvin-ailey-american-dance-theater/alvin-ailey\n','false'),(952,'other','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a90',NULL,'George','Balanchine','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a901efaca472164e8be56917520ae9e08b04','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(953,'other','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a90',NULL,'Pina','Bausch','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a901efaca472164e8be56917520ae9e08b04','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(954,'other','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a90',NULL,'Mats','Ek','dummyemail@abfe66bf65b37ab0e7b37adf5ce73650b511a901efaca472164e8be56917520ae9e08b04','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(955,'other','aceto@buffalo.edu',NULL,'Katherine','Dunham','dummyemail@d44bfc482d0799e9f892c6a6f033e110091fdf17072a4f57f857a3326799742422d0769a','deceased','1909-06-22','2006-05-21','Choreographer,Dancer,Other','Prefer not to answer','female','','Author, Educator','','','','Chicago','','United States of America','','Legendary dancer, choreographer and anthropologist Katherine Dunham was born June 22, 1909, to an African American father and French-Canadian mother who died when she was young. At an early age, Dunham became interested in dance. However, she did not seriously pursue a career in the profession until she was a student at the University of Chicago.\r\n\r\nDuring her studies, Dunham attended a lecture on anthropology, where she was introduced to the concept of dance as a cultural symbol. Intrigued by this theory, Dunham began to study African roots of dance and, in 1935, she traveled to the Caribbean for field research. Dunham was exposed to sacred ritual dances performed by people on the islands of Haiti and Jamaica. She returned to the United States in 1936 informed by new methods of movement and expression, which she incorporated into techniques that transformed the world of dance.\r\n\r\nIn 1940, she formed the Katherine Dunham Dance Company, which became the premier facility for training dancers. Alumnae include Eartha Kitt, Marlon Brando and Julie Belafonte. Dunham is credited with introducing international audiences to African aesthetics and establishing African dance as a true art form. Called the “Matriarch of Black Dance,” her groundbreaking repertoire combined innovative interpretations of Caribbean dances, traditional ballet, African rituals and African American rhythms to create the Dunham Technique, which she performed with her dance troupe in venues around the world. Her many original works include L’ag’ya, Shango and Bal Negre. She also choreographed and appeared in Broadway musicals, operas and the film Cabin in the Sky.\r\n\r\nThe Dunham troupe toured for two decades, stirring audiences around the globe with their dynamic and highly theatrical performances. These experiences provided ample material for the numerous books, articles and short stories Dunham authored.\r\n\r\nDunham accepted a position at Southern Illinois University in East St. Louis in the 1960s. During her tenure, she secured funding for the Performing Arts Training Center, where she introduced a program designed to channel the energy of the community’s youth away from gangs and into dance. Dunham was always a formidable advocate for racial equality, boycotting segregated venues in the United States and using her performances to highlight discrimination. She made national headlines by staging a hunger strike to protest the U.S. government’s repatriation policy for Haitian immigrants.\r\n\r\nThroughout her distinguished career, Dunham earned numerous honorary doctorates, awards and honors. She was the recipient of a Kennedy Center Honors Award, the Plaque d\'Honneur Haitian-American Chamber of Commerce Award, and a star on the St. Louis Walk of Fame.\r\n\r\nDunham passed away on Sunday, May 21, 2006 at the age of 96.','upload/photo_upload_data/1639193514picture-blank.png','',100,'4,14,31,65','East Indian, Javanese, Balinese','2021-12-10 23:27:38','2021-12-10 23:27:38','Biography: https://www.thehistorymakers.org/biography/katherine-dunham-40\nLineal Artists: https://www.loc.gov/collections/katherine-dunham/articles-and-essays/katherine-dunham-timeline/','false'),(956,'other','dummyemail@133bca942bd68433954f84dab5833922c66ebba',NULL,'Elisa',' Monte','dummyemail@133bca942bd68433954f84dab5833922c66ebba690730487b87a6feb2fe5c131d09c2af8','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(957,'other','dummyemail@5cd2ab943f3a13ec763ab8065ab7ef659a250aa',NUL