with her mother. In London, she caught the eye of Marie\r\nRambert, the director of the Ballet Club at Mercury Theater and studied extensively there for\r\nquite some time. After training in London, she began to find a love for choreography and her\r\ncareer took off quickly. In 1936, she had her first professional choreographic experience\r\nwith the film, Romeo and Juliet. Soon after, Ballet Theatre, (American Ballet Theatre) was\r\nfounded and de Mille became one of their main choreographers, choreographing \"Black\r\nRitual,\" the first ballet with black dancers done by a serious company. She also worked with\r\nBallet Russe, the Metropolitan Opera and Rodgers and Hammerstein on \"Oklahoma!\" She\r\ncontinued her Broadway choreographic streak with \"Bloomer Girl,\" \"Carousel,\" and \"One\r\nTouch of Venus.\" de Mille, a woman of many talents, began taking on roles other than\r\nchoreographer such as stage manager, producer and director for shows such as \"Allegro\"\r\n(1948), and \"River Legend\" (1948). In 1974, she created her own company, Agnes de Mille\r\nHeritage Dance Theatre but came to a quick end in 1975 when she suffered from a cerebral\r\nhemorrhage. This experience inspired her to write many books discussing her career and\r\nexpressing her love of dance. She die on October 7th, 1993 leaving the world of dance and\r\ntheater with some of the greatest work ever created.','','',100,'','','2020-10-28 04:28:01','2020-10-28 04:28:01','\"Agnes De Mille.\" American Ballet Theatre. N.p., n.d. Web. 9 November. 2014.\n\"Agnes DeMille.\" The John F. Kennedy Center for the Performing Arts. N.p., n.d. Web. 9\nNovember. 2014.\nPalfy, Barbra. â€œAgnes de Mille (1905- 1993).â€ Dance Heritage Coalition. 2012. Web. 9\nNovember 2014.','false'),(1103,'other','dummyemail@c9e7823dfe98ab102eb95de48806662e6516547',NULL,'Jerome','Robbins','dummyemail@c9e7823dfe98ab102eb95de48806662e65165470bb9d1d63b6dd697972a74ea403c68a42','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(1104,'other','aceto@buffalo.edu','','Bob ','Fosse','dummyemail@bd2097aa1d8cebc01abe3e05ff3f8db3c63c8e085fe0c98c5ec2240ef2cfd9d734d5dbf1','living','1996-02-20','0000-00-00','','','','','','','','','','','','','','','',25,'','','2020-10-15 14:20:52',NULL,NULL,'false'),(1106,'other','annacaisonboyd@gmail.com','','jh','khj','dummyemail@3d07a82b775afc960904fdedd7bd8c50a152cc25e6588529e82dfe20a30423b5b6413af5','living','2020-10-06','0000-00-00','','Hawaiian or Pacific Islander','female','','','','','','','','','','','','',75,'','','2020-10-18 12:28:22',NULL,NULL,'false'),(1107,'other','aceto@buffalo.edu','','Ginger','Rogers','pedroaco@buffalo.edu','deceased','1911-07-16','1995-04-25','','','female','','','','','','','','','','Virginia \"Ginger\" Katherine McMath was born in Independence, Missouri on July 16, 1911.\r\nShe gained the nickname Ginger when her little cousin couldn\'t pronounce Virginia, and\r\ncalled her Ginja. Her parents divorced and her mother got remarried to John Logan Rogers,\r\nwhere she adopted his last name as well. Influenced by her mother\'s work in theater, Rogers\r\ncareer started at the age of 14 when she won a Charleston dance contest.\r\n1925-1928 Vaudeville Theatres\r\nGinger appeared on stage in many productions, such as:\r\n1929 Top Speed\r\n1930 Girl Crazy\r\n1951 Love and Let Love\r\n1959 The Pink Jungle\r\n1960 Annie Get Your Gun\r\n1961 Bell, Book and Candle\r\n1961 Calamity Jane\r\n1962 Husband and Wife\r\n1963 The Unsinkable Molly Brown\r\n1963 A More Perfect Union\r\n1964 Tovarich\r\n1965-1968 Hello, Dolly!\r\n1969-1970 Mame\r\n1971 Coco\r\n1974 No, No, Nanett\r\n1974-1975 40 Carats\r\n\r\n1975-1979 The Ginger Rogers Show\r\n1980 Anything Goes\r\n1983 Miss Moffat\r\n1984 Charley\'s Aunt\r\nRogers also appeared in many films, but the first film she starred in was \"Young Man of\r\nManhattan\" in 1930. The first film Ginger starred in with Fred Astaire was \"Flying Down to\r\nRio\" in 1933, at the age of 22. Even though they may have appeared to be quaint on film,\r\nGinger claims that they weren\'t friends off camera. All together Rogers and Astaire made ten\r\nmusical films together. In 1941 Rogers received an Academy Award for the dramatic title\r\nrole in the film \"Kitty Foyle\" (1940).\r\nGinger rogers later then died on April 25, 1995 at the age of 83 in Rancho Mirage, California\r\non April 25, 1995.\r\nThe Craterian Ginger Rogers Theater in Medford, Oregon is named in her honor.','','',100,'','','2020-10-27 20:34:26','2020-10-27 20:34:26',NULL,'false'),(1108,'other','dummyhiddenemail',NULL,'Pedro','Bryan','dummyemail@63e1d49839bd7df5cd710fef9e2df3d21cd4abda10431092fefaf8171d82d5ff65f24f88','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(1109,'other','dummyemail@GusGiordano',NULL,'Ernest','Belcher','dummyemail@GusGiordano','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',14',NULL,NULL,NULL,NULL,'false'),(1110,'other','dummyemail@GusGiordano',NULL,'Nico','Charisse','dummyemail@GusGiordano','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(1111,'other','dummyemail@GusGiordano',NULL,'Eugene','Loring','dummyemail@GusGiordano','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',14',NULL,NULL,NULL,NULL,'false'),(1112,'other','dummyemail@GusGiordano',NULL,'Willie','Covan','dummyemail@GusGiordano','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',104',NULL,NULL,NULL,NULL,'false'),(1113,'other','dummyemail@GusGiordano',NULL,'Louis','DaPron','dummyemail@GusGiordano','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',104',NULL,NULL,NULL,NULL,'false'),(1114,'other','dummyemail@GusGiordano',NULL,'Cyd','Charisse','dummyemail@GusGiordano','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',65',