to@buffalo.edu','','Isadora','Duncan','dummyemail@9fca5e7251f4fb6d123279280651c32c9ff3dc63d286e21ad538176dc20717074c67405b','deceased','1877-05-28','1927-09-14','','','female','','','','','','','','','','TBU','','',100,'','','2020-10-27 21:27:08','2020-10-27 21:27:08',NULL,'false'),(1139,'other','dummyhiddenemail',NULL,'Augustin','Daly','dummyemail@e3078673032135792c48f727701a78c4394ae35cc545dfebabe0a3a81feca47738646ebc','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',31',NULL,NULL,NULL,NULL,'false'),(1140,'other','dummyhiddenemail',NULL,'Loie','Fuller','dummyemail@923a46eca6db1db92cc45f6f8fdf7aef3971a2cdfe96058abbcf6b11630c15c2d631302d','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',31',NULL,NULL,NULL,NULL,'false'),(1141,'other','aceto@buffalo.edu','','Frank','Hatchett','dummyemail@69c4e7eb57f3e792764c7deb8479cee3051fc1ea4cdfb744af0e631d947d2b9403103f4d','deceased','1935-12-07','2013-12-23','','','male','','','','','','','','','','The Frank Hatchett Center for The Performing Arts was founded by Frank Hatchett in 1967.\r\nFrank Hatchett grew up in Hartford, CT and Springfield, MA. He was always artistically\r\ninclined and on a dare from his friends decided to pursue dance in high school. Frank\r\nstudied dance under the guidance of such teachers as Marge Fielding Hayles (a former\r\nZiegfeld Follies dancer), June Taylor, Alvin Ailey, Henry LeTang and most of all, Syvilla Fort\r\nof The Katherine Dunham School of Dance in New York.\r\nFrank began a 10-year professional career that included appearances in major nightclubs in\r\nNew York, Las Vegas, and Miami and television appearances with Sammy Davis Jr., Eartha\r\nKitt, Harry Belafonte and Jackie Gleason.\r\nHe moved back to Springfield and realized that in his community there was a lack of dance\r\nschools that developed the potential that he saw in students. In 1967, he began a dance\r\nschool on Eastern Avenue with over one hundred children attending. With the help of the\r\nlate Robert Jennings, Frank moved his dance school to The Dunbar Community Center. Many\r\nof Frankâ€™s first students were on \"scholarships\" and didnâ€™t pay for classes.\r\nFrom the beginning, Frankâ€™s first students considered him more than a dance teacher.\r\nAnyone who visited the Dunbar could see students taking dance lessons in ballet, tap,\r\nmodern, afro, modeling, charm and even percussion. You would see others practicing\r\nroutines, helping with costumes or even doing homework. Frank always checked his\r\nstudentsâ€™ report cards to make sure that they were keeping up with their schoolwork. He\r\nwas known for suspending a student from classes for not keeping up with their class work.\r\n\r\nOver the years Frankâ€™s enrollment rose from 100 to over 500 students per dance year.\r\nIn addition to his dance school in Springfield, in the late 60â€™s and early 70â€™s, Frank also had\r\na dance school in Hartford, CT. He also choreographed many events throughout Western\r\nMass. Some of these events included: The Black Arts Festival, the Harambee Holiday, and the\r\nTech Tantrums Variety Show (which featured students from Technical High School). Frank\r\nand his students also performed at American International College, Cathedral High School,\r\nHuntington, Frederick Harris Elementary School, College Country Club in Belchertown,\r\nCrestview Country Club in Agawam, Twin Hills Country Club in Longmeadow and Boston and\r\nHartford, as well as the Eastfield Mall.\r\nFrank always presented a dance recital at the end of every dance school year; perhaps his\r\nmost memorable recital was in 1979 when he presented â€˜The Wiz is a Wow.â€™ Although it was\r\nadapted from the Broadway stage play, if nothing else, The Wiz is a Wow was a\r\nrambunctious reflection of Frankâ€™s sense of obligation to his childhood community and his\r\nlove of dance. This dance recital featured a full live orchestra, stage lighting, as well as his\r\nstudents performing songs and acting â€“ some for the very first time. Anyone who has ever\r\nseen a Hatchett School of the Performing Arts show here in Springfield knows how much of\r\nFrankâ€™s professional experience had been passed on to his students. After presenting The\r\nWiz is a Wow, Frank went on to present other dance recitals, with a Broadway theme: Brown\r\nSugar on Broadway and From Broadway to Hollywood.\r\nFrankâ€™s final dance recital took place in 1984, when he closed The Frank Hatchett Center for\r\nthe Performing Arts to concentrate his attention full time to the Hines-Hatchett Studio in\r\nNew York City, which he co-owned with Maurice Hines. (The Hines-Hatchett Studio would\r\nlater be re-named Broadway Dance Center.)\r\nEntertainers, students, and dance teachers from all over the world come to study with Frank\r\nHatchett at the Broadway Dance Center in New York City. Frank continuously tours the\r\ncountry giving master classes, and making special guest appearances. In addition, Frank is\r\none of the featured master teachers for the annual Jazz Dance World Congress.\r\nThe Hatch','','',100,'','','2020-10-27 21:37:48','2020-10-27 21:37:48',NULL,'false'),(1142,'other','dummyhiddenemail',NULL,'Marge','Fielding-Hayles','dummyemail@4aaca311c3c61388cf4c3cfe63482e0617bf3b9ded9a97fce95e9383eeeb5b180cb8529e','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',65',NULL,NULL,NULL,NULL,'false'),(1143,'other','dummyhiddenemail',NULL,'June','Taylor','dummyemail@f36d909bf6985e75b35b715c858313d6d5d51406aa52411d85ea12370f7c6864ae3c445c','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',65',NULL,NULL,NULL,NULL,'false'),(1144,'other','simonsondance@gmail.com',NULL,'Syvilla','Fort','simonsondance@gmail.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',31,65',NULL,NULL,NULL,NULL,'false'),(1145,'other','simonsondance@gmail.com',NULL,'Maurice','Hinds','simonsondance@gmail.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(1146,'other','dummyemail@92dffd36367e0f2addd19718ddd4cdc3a49d357',NULL,'David','Belasco','dummyemail@92dffd36367e0f2addd19718ddd4cdc3a49d357448ecb13df6e6f3affa6c71dff1e6c611','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(1147,'other','aceto@buffalo.edu','','Gene','Kelly','dummyemail@dfe8e5eb0ddbae5e057eb87177225e1b1a025e6269f151852e759ada1a09bd3bc682d865','deceased','1912-08-23','1996-02-02','','Caucasian or White','male','','','','','','','','','','Gene Kelly was born in Pittsburgh, Pensilvania. His full name was Eugene Curran Kelly, but\r\nhe was later nicknamed Gene. Durning his youth, Kelly was made fun of for dancing and did\r\nnot do so from the years of 8 to 15. During that time, he became efficient in sports, which\r\nprobably influenced his energetic, athletic movement style later in life. During World War\r\nTwo, there was a lot of competition in the entertainment field but Kelly was still able to rise\r\nto the top, probably partly to do with his famous good looks. In 1940, he was in the\r\nBroadway production \"Pal Joey\" and was in the movie \"For Me and My Gal\" with Judy\r\nGarland. Aside from being an avid performer, Kelly also excelled in choreography. He is best\r\nknown for choreography in \"An American In Paris,\" and dancing in \"Singing in the Rain.\"\r\nKelly wanted to be remembered for his work behind the camera, which included\r\nchoreographing, directing, writing and producing.','','',100,'','','2020-10-27 21:56:14','2020-10-27 21:56:14','Chester, Cathy. \"Gene Kelly Is Timeless: My Interview With Patricia Ward Kelly And How Her\nShow\nContinues Her Husband\'s Legacy.\" The Huffington Post. TheHuffingtonPost.com, 08 Aug.\n2014.\n\nWeb. 11 Nov. 2014. <http://www.huffingtonpost.com/cathy-chester/gene-\nkelly_b_5630513.html>.\n\n\"Gene Kelly.\" IMDb. IMDb.com, n.d. Web. 11 Nov. 2014.\n<http://www.imdb.com/name/nm0000037/>.\n\"Overview for Gene Kelly.\" Turner Classic Movies. N.p., n.d. Web. 10 Nov. 2014.\n<http://www.tcm.com/tcmdb/person/100306%7C57646/Gene-Kelly/>.\nShwiff, Kathy. \"Gene Kelly\'s Widow Doesn\'t Dance Away From His Secrets.\"\nHttp://blogs.wsj.com.\n\nN.p., n.d. Web. <http://blogs.wsj.com/speakeasy/2012/07/24/gene-kellys-widow-doesnt-\ndance-\naway-from-his-secrets/>.','false'),(1148,'other','dummyhiddenemail',NULL,'Charles','Gaynor','dummyemail@dce03e53c33b029c1523145cca0a19124ceeacdee36f0c7fb1e5056b2af6d334ac043272','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(1149,'other','dummyhiddenemail',NULL,'Busby','Berkely','dummyemail@e8d93b185391f9979f5f2eb7f070c657baaa1afc7bfdb95bc52af10a9793fc25e52c0f27','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',65',NULL,NULL,NULL,NULL,'false'),(1150,'other','dummyhiddenemail',NULL,'Patrica-ward','Kelly','dummyemail@1da3e101e0217d21b94f155672693ce5b0efce2388cf32a00c8c5a3aa40f80805599076c','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(1151,'other','dummyemail@01bac36133ea783abac4de6e06f8b9300277268',NULL,'Frank','Sinatra','dummyemail@01bac36133ea783abac4de6e06f8b9300277268f32d45145578c523ca3b26addb7e4c7d9','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(1152,'other','dummyemail@01bac36133ea783abac4de6e06f8b9300277268',NULL,'Bill','Robinson ','dummyemail@01bac36133ea783abac4de6e06f8b9300277268f32d45145578c523ca3b26addb7e4c7d9','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',104',NULL,NULL,NULL,NULL,'false'),(1153,'other','dummyemail@01bac36133ea783abac4de6e06f8b9300277268',NULL,'Dotson','Clarence ','dummyemail@01bac36133ea783abac4de6e06f8b9300277268f32d45145578c523ca3b26addb7e4c7d9','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',104',NULL,NULL,NULL,NULL,'false'),(1154,'other','dummyemail@01bac36133ea783abac4de6e06f8b9300277268',NULL,'Harriet','Kelly','dummyemail@01bac36133ea783abac4de6e06f8b9300277268f32d45145578c523ca3b26addb7e4c7d9','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',14,31,117,65,104',NULL,NULL,NULL,NULL,'false'),(1155,'other','aceto@buffalo.edu','','Fred','Astaire ','dummyemail@29bdd0c4f242477a773e742f4b731f994aef5aa26aa9c46a27906dad2dc69d5fd696202d','deceased','1899-05-10','1987-06-22','','African American or Black','male','','','','','','','','','','Born on May 10, 1899, in Omaha, Nebraska, Fred Astaire is regarded by many as the\r\ngreatest popular music dancer of all time. Astaire is usually remembered for his pairings\r\nwith Ginger Rogers, who starred in several films with him, including Swing Time (1936).\r\nLight on his feet, Fred Astaire revolutionized the movie musical with his elegant and\r\n\r\nseemingly effortless dance style. He may have made dancing look easy, but he was a well-\r\nknown perfectionist, and his work was the product of endless hours of practice.\r\n\r\nAstaire started performing as a child, partnering up with his older sister Adele. The two\r\ntoured the vaudeville circuit before making it to Broadway in 1917. Among their many\r\nproductions the brother-sister team starred in the 1927 George and Ira Gershwin musical\r\nFunny Face. For all his early success, though, career in the movies alluded Astaire. He had\r\ndone a screen test, but he failed to attract any interest. A studio executive wrote at the time,\r\n\"Can\'t sing. Can\'t act. Slightly balding. Can dance a little.\"\r\nIn 1932, Astaire suffered a career setback. His sister Adele retired from the act to marry a\r\nBritish aristocrat. He floundered a bit professionally without his usual partner, but then\r\ndecided to go to Hollywood to try once more to break into film.\r\nFinally, Astaire landed a small role in 1933\'s Dancing Lady with Joan Crawford. The role\r\nopened the door to new opportunities, and Astaire signed a contract with RKO Radio\r\nPictures. He was matched up with another Broadway talent, Ginger Rogers, for Flying Down\r\n\r\nto Rio, also in 1933. Cast as supporting players, their dance number stole the movie. Astaire\r\nand Rogers appeared in several more films together, including The Gay Divorcee (1934) and\r\nTop Hat (1935). The duo became film\'s most beloved dance team. Their routines featured a\r\nhybrid of stylesâ€”borrowing elements from tap, ballroom and even ballet. Katharine Hepburn\r\nonce described what each of them brought their successful partnership: \"Fred gave Ginger\r\nclass, and Ginger gave Fred sex.\"\r\nOff-screen, Astaire was known for his relentless pursuit of perfection. He thought nothing\r\nof rehearsing a scene for days, and Rogers eventually tired of the grueling schedule. The\r\npair went their separate ways after 1939\'s The Story of Vernon and Irene Castle. Years later,\r\nthey reunited once more for 1949\'s The Barkleys of Broadway.\r\nAfter the split with Rogers in 1939, Astaire performed with such leading ladies as Rita\r\nHayworth, Cyd Charisse, Judy Garland, Leslie Caron and Audrey Hepburn. Some of his most\r\nfamous musicals from his later career include Easter Parade with Garland and Funny Face\r\nwith Hepburn.\r\nAs his movie roles tapered off, Astaire worked more in television. He often appeared as\r\nhimself for special tribute shows. Astaire had a growing interest in dramatic parts, working\r\non such series as Dr. Kildare. He also worked with another legendary dancer, Gene Kelly, on\r\nthe documentary That\'s Entertainment, which explored the golden era of the movie musical.\r\nAround this time, Astaire received his only Academy Award nomination for his supporting\r\nrole in the 1974 disaster film The Towering Inferno. He also won an Emmy Award for his\r\nwork on the television special A Family Upside Down in 1978. More accolades soon\r\nfollowed. Astaire received a Lifetime Achievement Award from the American Film Institute in\r\n1981.\r\nA few years later, Astaire was hospitalized for pneumonia. He died on June 22, 1987, in Los\r\nAngeles, California. With his passing, Hollywood had lost one of its greatest talents. Former\r\nactor and president Ronald Reagan, upon learning the news, called Astaire \"an American\r\nlegend\" and \"the ultimate dancer.\" Ginger Rogers said Astaire \"was the best partner anyone\r\ncould ever have.\"\r\nOff-screen, Astaire was more casual than his upper-crust characters. He was devoted to his\r\nfamily. Astaire and his first wife, socialite Phyllis Baker Potter, married in 1933 and had two\r\nchildren together, ','','',100,'','','2020-10-27 22:01:19','2020-10-27 22:01:19',NULL,'false'),(1156,'other','aceto@buffalo.edu','','Vera Ellen','Westmeier Rohe','dummyemail@99e3f9c1df7e160acb939dfb3e248403abada348f619cd648098023609f87736162f8ac1','deceased','1921-02-16','1981-08-30','','','female','','','','','','','','','','Vera-Ellen began dancing at the age of 10, and a few years later became one of the youngest\r\nRockettes. She appeared in several Broadway musicals until she was spotted by film producer\r\nSamuel Goldwyn in 1945. She was only 24 years old when Goldwyn cast her opposite Danny Kaye in\r\nWonder Man (1945). She danced with Fred Astaire in Three Little Words (1950) and with Gene Kelly\r\nin On the Town (1949). Blonde, slim of build, and a dancing sensation, she appeared in a string of\r\nlight-hearted but successful films. Vera-Ellen retired from acting in the late 1950s.\r\n- IMDb Mini Biography By: David Westman','','',100,'','','2020-10-28 04:05:06','2020-10-28 04:05:06','Brumburgh, Gary. &quot;Vera-Ellen Biography.&quot; IMDb. Web. 6 Nov. 2014.\n&lt;http://www.imdb.com/name/nm0893584/bio?ref_=nm_ov_bio_sm&gt;.\nFrazzetta, Joe. &quot;Vera-Ellen.&quot; Films in Review 46.3/4 (1995): 2. University At Buffalo Library. Web. 6\nNov. 2014.\nLobosco, David. &quot;Vera-Ellen: The Later Years.&quot; 21 Dec. 2012. Web. 6 Nov. 2014.\n&lt;http://greatentertainersarchives.blogspot.com/2012/12/vera-ellen-later-years.html&gt;.\n&quot;Vera Ellen Full Biography.&quot; New York Times. Web. 6 Nov. 2014.\n&lt;http://www.nytimes.com/movies/person/73296/Vera-Ellen/biography&gt;.','false'),(1157,'other','dummyemail@29bdd0c4f242477a773e742f4b731f994aef5aa',NULL,'Kelly','Gene','dummyemail@29bdd0c4f242477a773e742f4b731f994aef5aa26aa9c46a27906dad2dc69d5fd696202d','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',65,104',NULL,NULL,NULL,NULL,'false'),(1158,'other','dummyemail@29bdd0c4f242477a773e742f4b731f994aef5aa',NULL,'Donald','O\'Connor','dummyemail@29bdd0c4f242477a773e742f4b731f994aef5aa26aa9c46a27906dad2dc69d5fd696202d','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',65,104',NULL,NULL,NULL,NULL,'false'),(1159,'other','dummyemail@29bdd0c4f242477a773e742f4b731f994aef5aa',NULL,'Danny','Kaye','dummyemail@29bdd0c4f242477a773e742f4b731f994aef5aa26aa9c46a27906dad2dc69d5fd696202d','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',65,104',NULL,NULL,NULL,NULL,'false'),(1160,'other','dummyemail@29bdd0c4f242477a773e742f4b731f994aef5aa',NULL,'Rosemary','Clooney','dummyemail@29bdd0c4f242477a773e742f4b731f994aef5aa26aa9c46a27906dad2dc69d5fd696202d','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',65,104',NULL,NULL,NULL,NULL,'false'),(1161,'other','dummyemail@29bdd0c4f242477a773e742f4b731f994aef5aa',NULL,'Martin ','Tony','dummyemail@29bdd0c4f242477a773e742f4b731f994aef5aa26aa9c46a27906dad2dc69d5fd696202d','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(1162,'other','aceto@buffalo.edu','','Anna','Pavlova','dummyemail@afd9baf549febf52a0731a979e14b1d2f147f07bd93aedbad5c9709ceb75f105a55164ba','deceased','1881-02-12','1931-01-23','','Caucasian or White','female','','','','','','','','','','Anna Pavlova was a Russian prima ballerina of the late 19th and the early 20th centuries.\r\nShe was a principal artist of the Imperial Russian Ballet and the Ballets Russes of Sergei\r\nDiaghilev. Pavlova is most recognized for the creation of the role The Dying Swan and, with\r\nher own company, became the first ballerina to tour ballet around the world.','','',100,'','','2020-10-28 04:16:21','2020-10-28 04:16:21',NULL,'false'),(1163,'other','dummyhiddenemail',NULL,'Serge','Diaghilev','dummyemail@f700cbf0df7fccbd1e40324fb12039b52dcb7f38a688891850f4214b2c5c272310eba548','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(1164,'other','dummyhiddenemail',NULL,'Marius','Petipa','dummyemail@9653080419a74c2dd956e4399065282f518b76a27843039a2de1f5be0f1e01270750f8a8','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',14',NULL,NULL,NULL,NULL,'false'),(1165,'other','dummyhiddenemail',NULL,'Michel','Fokine','dummyemail@3d2c0ba2387acf235381473d5fc7ae39f0205542f3ae2a7807ea78517847b8eaa959e853','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',14',NULL,NULL,NULL,NULL,'false'),(1166,'other','dummyhiddenemail',NULL,'Pavel','Gerdt','dummyemail@ea4a817a97a8e3bff27c4b7123cb0556f6dd5dd364da9b612cc262a3c31b751de97275d0','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(1167,'other','dummyhiddenemail',NULL,'Enrico','Cecchetti','dummyemail@451acb92af261282273f7c20ebfc65dc45c89b54172c0edd51217316380e23a84f58aa4b','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',14',NULL,NULL,NULL,NULL,'false'),(1168,'other','dummyhiddenemail',NULL,'Ekaterina','Vazen','dummyemail@c397f7810016f40c08b58228cc74ef4cbc47db933289080e85b2e5de3c28f05d375da1fc','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',14',NULL,NULL,NULL,NULL,'false'),(1169,'other','dummyhiddenemail',NULL,'Christian','Johansson','dumm