om Rochester, NY, is an educator and movement artist based in Brooklyn, NY. He is currently on faculty at Wagner College on Staten Island where he teaches Jazz and Contemporary dance courses. He is actively involved with his partner and collaborator, Mar Undag, on a variety of choreographic projects and performances. In 2021, he graduated from The University of Utah with a Master of Fine Arts in Modern Dance where he was the recipient of the L. Scott Marsh Mentorship Award and the LGBT Resource Center Scholarship. He is deeply passionate about his work as an educator and is an advocate for co-creating classrooms that are inclusive, empowering, and energizing. As a teaching artist, Elliott has spent a great deal of time teaching for schools and studios throughout the country. Internationally, he has taught in Argentina as a PizArts teaching fellow and Panama City, Panama with the group Movement Exchange.\r\n\r\nElliott received his Bachelor of Fine Arts in Dance from the University at Buffalo, performing with the Zodiaque Dance Company and Melanie Aceto Contemporary Dance Company at Jacob\'s Pillow. He supplemented his training through his studies with the Limón Dance Company, Paul Taylor Dance Company, Parsons Dance, and the Joffrey Ballet School. As a performer, Elliott has worked in a variety of commercial and concert settings, including Celebrity Cruises, Busch Gardens, the all-male group Project 44, Sans Limites Dance, and Ballaro Dance. While living in Salt Lake City, UT he performed works by Charles Anderson and Penny Saunders for Salt Contemporary Dance.\r\n','upload/photo_upload_data/1661262322IMG_8472lron.jpg','',100,'14,115,30,31,117,65,71,78,104,114','','2022-08-23 09:58:04','2022-08-23 09:58:04',NULL,'false'),(1185,'artist','saicao@buffalo.edu','saicao@buffalo.edu','Sai','Cao','saicao@buffalo.edu','living','1999-09-23','0000-00-00','Other','Asian','male','','Computer Science','','Buffalo','NY','','United States of America','','upload/biography_upload_dat