85-11-27','0000-00-00','Actor,Choreographer,Dancer','Caucasian or White','male','','','','Buffalo','NY','','United States of America','','','Michael Deeb Weaver is an accomplished dancer, actor, instructor, and choreographer based in Buffalo, NY. His experience as a performer rangesâ€‹ from concert dance to musical theatre to commercial work â€“ and (almost) everything in between. He holds a BFA in Dance from the University at Buffalo, and is a faculty member at both UB and at Nazareth College, teaching jazz, tap, and musical theatre dance styles. \r\n\r\nMichael\'s performance credits have taken him all over the world, including National Tours of A Chorus Line (Mike), and Young Frankenstein the Musical (Swing). As a member of the Actors\' Equity Association, he has served as Dance Captain, Assistant Choreographer, and/or Assistant Director for productions of Kinky Boots, Thoroughly Modern Millie, My Fair Lady, Gypsy, Mame, and Young Frankenstein the Musical (West Coast regional premiere). Additional regional theatre credits include West Side Story, Hello, Dolly!, Saturday Night Fever, Singin\' in the Rain, The Wizard of Oz, A Chorus Line, Joseph..., and Beauty and the Beast. In addition to numerous industrials, Michael has performed for Celebrity Cruises and Six Flags. In 2017, he was part of the pre-Broadway choreography lab of Beetlejuice the Musical. These experiences have allowed him to work with notable directors and choreographers like Baz Luhrmann, Connor Gallagher, Baayork Lee, Jeff Whiting, Jeffry Denman, Marc Robin, and Susan Stroman.\r\n\r\nMichael\'s choreography has most recently been featured on the famous Las Vegas Strip as a part of Picturesque, a new burlesque tap revue. In 2021 he co-directed and choreographed for The Center in Motion, a filmed dance concert at the University at Buffalo\'s Center for the Arts. He has also set choreography on UB\'s Zodiaque Studio Dance Ensemble, and was a guest instructor at Montclair State University. Nationally, Michael has served as an instructor and adjudicator for dance conventions including Platinum National Dance Competition and Turn it Up Dance Challenge. Additionally, he has held positions as a faculty member and choreographer for award-winning dance studios across the country.\r\n\r\nIn Western New York, Michael has performed onstage at Artpark and for Theatre of Youth, in addition to appearances with Buffalo Contemporary Dance and the Greater Buffalo Youth Ballet. In 2012, he had the honor of dancing in the University at Buffalo\'s Back to Buffalo concert, which brought notable UB Dance alumni back to the CFA for a one-night event. \r\n\r\nMichael currently lives in Orchard Park with his husband, Eric, and their two dogs, Koko and Polly.','upload/photo_upload_data/1616803497MichaelDeeb-68-Edit.jpg','',100,'14,31,117,65,71,78,104','','2021-04-25 15:31:06','2021-04-25 15:31:06',NULL,'false'),(1294,'other','tpralabate@gmail.com',NULL,'Linda','Swiniuch','tpralabate@gmail.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'false'),(1295,'other','tpralabate@gmail.com',NULL,'Tressa','Crehan','tpralabate@gmail.com','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,'',NULL,NULL,NULL,NULL,'true'),(1296,'other','dummyhiddenemail',NULL,'Dave','Covey','dummyemail@287c7d4e98cb9b9eb05e4c2a09589450dbd04165dc6b6c3ee3e73b6fcfbbcf0d8f5f461d','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',31,117',NULL,NULL,NULL,NULL,'false'),(1297,'other','dummyhiddenemail',NULL,'Jessica','Odasz','dummyemail@9c731e1c56e4d1f5779ccd95b93c4e1b18db5c178f1d12206ff06f5fe7ac9d22762b015f','','0000-00-00','0000-00-00','','','','','','','','','','','','','','','',0,',14',NULL,NULL,NULL,NULL,'false'),(1298,'artist','hbai@buffalo.edu','','Hanzhang','Bai','hbai@buffalo.edu','living','1998-04-09',NULL,'Actor,Dancer','Asian','male','','','','','','','','','','lolol','upload/photo_upload_data/1619122107panda