ique training in ballet, modern, jazz, contemporary, acro, Spanish, salsa, tango, jive, etc. In 2008 the United States could see her potential and she was placed on the USA National Junior Olympic Team. She then continued her career and earned a spot on the USA Senior Rhythmic Gymnastics National Team for 3 years. In 2012, she was named to the 2012 London Olympic Team for TEAM USA as a Reserve Athlete. She is currently and has been a member of the Canadian Senior Rhythmic Gymnastics Team for 6 years earning special awards for most expressive, best performer/dancer, most logical and well put together choreography, and best prop manipulator in the world. She has been a guest performer and choreographer at the prestigious Miss Valentine in Tallinn Estonia, the Toronto Philharmonic Orchestra, NBA Halftime shows, the Deriugina School in Dubai, Royale Dance Academy-Theatre Center for Performing & Visual Arts productions, Buffalo Opera Unlimited productions, Lake Shore Community Players, SUNY Fredonia Theatre Department, Niagara Falls Performing Arts Festival, and other programs across the United States. She is a well renowned and sought-after choreographer for artistic gymnastics routines, rhythmic gymnastics routines, competition dance routines, musicals, operettas, and dinner theaters. She received a special invitation to be on the well-known TV show Americaâ€™s Got Talent. She hopes to continue her education receiving a M.F.A. in Dance; eventually teaching as a professor in a university sharing all the knowledge she has acquired over the years from her vast teachers and experience. ','upload/photo_upload_data/1628955194Hannah Walter Head Shot.PNG','',100,'1,14,21,23,24,27,31,42,53,117,65,119,71,78,89,90,92,93,100,103,107,111,114','Lyrical Gymnastics, Rhythmic Gymnastics, Artistic Gymnastics, Prop Specialist','2021-10-28 15:52:38','2021-10-28 15:44:34',NULL,'false'),(1357,'other','dummyhiddenemail',NULL,'Chanon','Judson','dummyemail@d52adc92b31a7341ebd270529ec341f2c35c9