ecd6db6f76afc','living','1966-02-22',NULL,'Choreographer,Dancer','Caucasian or White','female','','','','','','','','','','Mia Michaels Melchiona (known professionally as Mia Michaels, born February 23, 1966) is an American choreographer and judge on the television show So You Think You Can Dance. She has worked with Tom Cruise, Celine Dion, Gloria Estefan, Madonna, Ricky Martin, Prince, and Catherine Zeta-Jones. In 2005 she choreographed Cirque du Soleil\'s world tour Delirium and Celine Dion\'s A New Day,[1] for which she received an Emmy Award nomination. In 2007 she won a Primetime Emmy Award for Outstanding Choreography for her routine on \"Calling You\" during season two of So You Think You Can Dance. She won another Emmy Award during season five in 2010.[2] She was a judge during season 7 with Adam Shankman and Nigel Lythgoe. She choreographed the dance sequence for \"Get Happy\" in the episode \"Bombshells\" of the television series House.','','',100,'31','','2021-12-18 21:18:17','2021-12-18 21:18:17','Biography from Wikipedia 9/13/2021\nLineal Artists: https://www.imdb.com/name/nm1677074/bio?ref_=nm_ov_bio_sm','false'),(1383,'other','aceto@buffalo.edu','','Grover','Dale','dummyemail@5e0694a4dd43d3080f036c45bc192fee4846e15c5e48b03d1eea2761af3947ff337de078','living','1935-07-22',NULL,'Dancer','Caucasian or White','male','','','','','','','','','','Dale\'s Broadway stage debut was in the 1956 musical Li\'l Abner as a dancer. He appeared in the original cast of West Side Story as Snowboy, a member of the Jets gang. Other stage credits include the role of Andrew in Greenwillow, in which he also understudied Anthony Perkins as Gideon Briggs; Noël Coward\'s Sail Away, where he had the juvenile lead role of architect Barnaby Slade; and in Half a Sixpence, where he played Pearce, one of a quartet of 19th century London shop apprentices around whom the show is structured.[citation needed]\r\n\r\nHe made his film debut in The Unsinkable Molly Brown (as Jam). He also appeared in Half a Sixpence (Pearce), The Young Girls of Rochefort (Bill), and The Landlord (Oscar).[citation needed]\r\n\r\nDale was nominated for the Tony Award twice, for his choreography of Billy, a musical version of the Herman Melville novella, Billy Budd, and his direction of The Magic Show. As co-director of Jerome Robbins\' Broadway, he shared Best Director Tony Award with the famed director-choreographer Jerome Robbins. He also received an Emmy Award nomination for his choreography of Barry Manilow\'s 1985 television musical Copacabana. In 1992 he became publisher/editor of Dance & Fitness magazine. In 1999 Dale founded the website, Answers4Dancers.com, whose stated goal is \"to empower dancers and choreographers to think, to grow, and to create satisfying careers for themselves...\"[citation needed]','','',75,'104','','2021-12-18 21:18:44',NULL,'DOB: Wikipedia 9/13/2021\nBrief Bio:  Wikipedia 9/13/2021','false'),(1384,'other','',NULL,'Alex','Gatsuke','dummyemail@568784fb50788ed67c519d2b65c0782949e85b6888c207a9574192ebede79d1d88df1173','',NULL,NULL,'','','','','','','','','','','','','','','',0,',14',NULL,'2021-09-17 20:36:40',NULL,NULL,'false'),(1385,'other','',NULL,'tom','relebate','dummyemail@3cdad8baf0c9f76d7a155c0ec455e62dd26bd126a20732020e5485d699ca62410ca2302d','',NULL,NULL,'','','','','','','','','','','','','','','',0,',65',NULL,'2021-09-17 20:37:08',NULL,NULL,'true'),(1386,'other','',NULL,'Anne Harris','Wilcox','dummyemail@1f2d283e03d1f9e51a910c3021925eb5b871d80dbe7afbf31741744d6e909232aa2ce5ca','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-09-18 12:39:13',NULL,NULL,'false'),(1387,'other','',NULL,'Shane','Shanahan','dummyemail@5e392bfbe3bdea3b35fb1ca60b35ac6e0c38e9af138fc4dd4ecde717fe90d42959104f04','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-09-18 12:44:23',NULL,NULL,'false'),(1388,'other','',NULL,'Mickey','Mouse','dummyemail@136c296cc848a4731608a6b571b1f6bb18686a01aa3dc66240d103f8b21715f8