PA','','United States of America','United States of America','','','upload/photo_upload_data/1635101306Screen Shot 2021-10-11 at 11.31.12 AM.png','',100,'14,115,30,31,117,65,50','','2021-10-24 14:54:35','2021-10-24 14:54:35',NULL,'false'),(1422,'other','',NULL,'Irene','Seeley','dummyemail@397507d302981c69fa51b75cc5e3ba970c1f763554093a6bc1ee3bcb37507cf8350e23c8','',NULL,NULL,'','','','','','','','','','','','','','','',0,',65,78,104',NULL,'2021-10-24 14:51:29',NULL,NULL,'false'),(1423,'other','alice3ms@gmail.com',NULL,'Alice','Condadina','alice3ms@gmail.com','',NULL,NULL,'','','','','','','','','','','','','','','',0,',31',NULL,'2021-10-24 14:52:38',NULL,NULL,'false'),(1424,'other','hcwalter@buffalo.edu','','Takehiro (Take)','Ueyama','take@takedance.org','living','1967-03-10',NULL,'Choreographer,Dancer','Asian','male','','','','New York','NY','','United States of America','Japan','','Born and raised in Tokyo, Japan, Takehiro “Take” Ueyama moved to the United States in 1991 to study dance at the Juilliard School in New York City. Upon graduation, he was invited to join the Paul Taylor Dance Company, touring the world with them for 8 years.\r\n\r\nIn 2003 Ueyama debuted his first choreographic work, Tsubasa, performed with fellow Taylor dancers at the McKenna Theatre at SUNY New Paltz, NY, and in 2005 founded TAKE Dance. He has performed repeatedly as a guest artist with with Kazuko Hirabayashi Dance Theatre. His television and film credits include PBS’s Dance in America series (with the Taylor Company), Acts of Ardor, and Dancemaker, a film by dancer/choreographer Matthew Diamond.\r\n\r\nHaving been a baseball player in Japan before fully committing to dance, Ueyama’s work blends both eastern and western sensibilities. Containing both powerful athleticism, as well as traces of his Japanese heritage by employing delicate gestures, his repertoire has been inspired by the beauty in nature, the duality of darkness and light in the universal human condition and the humanity and compassion in day-to-day living. These elements, combined with his various partnerships and collaborations with artists of other genres, lend diversity to movement, music and subject matter. Described as both sensitive and exciting, Ueyama’s choreography ensures a place for the heart on any stage it appears, a feast for the eyes, mind and soul; it is uniquely, “TAKE”.\r\n\r\nIn 2005 Ueyama’s ‘s work, Sakura Sakura was a prizewinner at the International Modern Dance Choreographic Competition in Spain, and he was one of four choreographers selected for 2006 Free to Rep at FSU’s Maggie Allesee National Center for Choreography. In 2010 he was the first choreographer to win the S & R Foundation’s prestigious Washington Award. Ueyama received the 2015 Jadin Wong Award for Emerging Asian American choreographer by Asian American Arts Alliance.\r\n\r\nUeyama has created and re-staged works for The Alvin Ailey School, Tallahassee Ballet, The New School, The Juilliard New Dances, Purchase College, Princeton University, Vassar College, Marymount Manhattan College, Randolph College, The Hartt School, Adelphi University, Roger Williams University, Grand Valley State University, University of New Mexico, Perry-Mansfield Performing Arts School, the International Summer Dance in Burgos, Spain and ArcDanz in Mexico, Circo Fantazztico in Cost Rica and Trainor Dance.','upload/photo_upload_data/1636208274take profilr pic.JPG','',100,'14,15,31','Break Dancing, Character, Social Dance','2021-11-06 13:08:25','2021-11-06 13:08:25',NULL,'false'),(1425,'other','dummyhiddenemail',NULL,'Kazuko ','Hirabayashi','dummyemail@13847f95e32680d6a30c14e565c48b4957db4047719cc2dfb78ebe38e7b28b328083f75c','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-11-06 10:25:56',NULL,NULL,'false'),(1426,'other','',NULL,'Linda','Kent','dummyemail@f3a733408a0b1e63358e08e308e77ee80b88a65adb4c575792c8bedba87e6022ea53649d','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,