ff45e8','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-11-27 21:30:48',NULL,NULL,'false'),(1485,'other','dummyhiddenemail',NULL,'John','Kander','dummyemail@1cca7fa4f7fd27016040d6df86219cfe23649a122fcb1110bb516c3f0e693cb7f1a94a7f','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-11-27 21:31:47',NULL,NULL,'false'),(1486,'other','dummyhiddenemail',NULL,'Fred','Ebb','dummyemail@2eb18682bb5d9f5d21ee9bbdd8309ac0c50518ed56ddc311c03f196246a05554b43b45a4','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-11-27 21:32:05',NULL,NULL,'false'),(1487,'other','dummyhiddenemail',NULL,'Hal','Prince','dummyemail@739d222b6214aa69498657ad5f30f24997d5f4a4421819593da5ebe0205c03ff659217ab','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-11-27 21:34:36',NULL,NULL,'false'),(1488,'other','dummyhiddenemail',NULL,'Scott ','Ellis','dummyemail@a33dea622a338df3438795dbde22c6910bf587acc576c6edf3168ee6ea3be880b12d7b6d','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-11-27 21:35:42',NULL,NULL,'false'),(1489,'other','dummyhiddenemail',NULL,'David ','Thompson','dummyemail@b4ea08c5890018b00f05636f1f3a31ac428809e513b87549524c84ad210439898f496928','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-11-27 21:36:05',NULL,NULL,'false'),(1490,'other','aceto@buffalo.edu','','Bella ','Lewitzky','dummyemail@e6dd5a329c3839a193b507e6d7904fa5e4630d54f389a9eb846023c8aa7bc7f593f45661','deceased','1916-01-13','2004-07-16','Choreographer,Dancer','Prefer not to answer','female','','','','','','California','','United States of America','','In Brief\r\nDancer and choreographer Bella Lewitzky was as famous off stage as on, thanks to her battles for freedom of expression against the House Un-American Activities Committee and the National Endowment for the Arts. Lewitzky joined Lester Horton’s modern dance company in 1934, became his lead dancer, and helped develop his experimental technique. In 1940 she married fellow dancer Newell Taylor Reynolds, and the pair collaborated with Horton to create Dance Theater, a multi-racial troupe that performed politically progressive dances. She formed her own dance company in 1966, both choreographing and performing. She chaired the contemporary dance department at Idyllwild Arts Academy, was founding dean of the California Institute of the Arts’s School of Dance, and was a dedicated political activist throughout.\r\nFor more than six decades, Bella Lewitzky, a maverick in the world of modern dance, distinguished herself as a preeminent performer, choreographer, artistic director, educator, public speaker, and civic activist. With an unshakable preference for living on the American West coast, she defied norms that posited New York City as the center of American dance, maintaining the Lewitzky Dance Company in Los Angeles for over thirty years. She was also known for two highly publicized encounters with the federal government, risking professional ostracism to stand upon principle.','upload/photo_upload_data/1638672234picture-blank.png','',100,'14,31','','2021-12-04 21:44:23','2021-12-04 21:44:23','Biography: https://jwa.org/encyclopedia/article/lewitsky-bella','false'),(1491,'other','',NULL,'Newell Taylor ','Reynolds','dummyemail@0d088d8013fecfddf823d3387607fe37c402b869b611000c007584c6287054f88b66d999','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-03 20:51:12',NULL,NULL,'false'),(1492,'other','dummyhiddenemail',NULL,'William ','Bowne','dummyemail@25676af428d45e81b36bab2c4d05e9dec110f3d6dabf41c06864e664883004ebd60afab6','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-03 21:22:53',NULL,NULL,'false'),(1493,'other','aceto@buffalo.edu','','Gregory ','Hines ','dummyemail@a3f9058122a644959f09ccef5572c381412460e74f678c9857e0202984c9a1ceee5c2c21','deceased','1946-02-14','2003-08-09','Actor,Choreographer,Dancer,Other','Prefer not to answer','male','