ULL,NULL,'false'),(1501,'other','simonsondance@gmail.com',NULL,'Nell ','Carter','simonsondance@gmail.com','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-03 22:14:31',NULL,NULL,'false'),(1502,'other','',NULL,'Judith ','Jamison','dummyemail@eb1d9a7cbed8fe1e008e2d4c945ccececfdbcbc9cfa54c47f3d7dd75660658812c4b0747','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-03 22:17:24',NULL,NULL,'false'),(1503,'other','',NULL,'Mel ','Brooks','dummyemail@5f5fa4ac3c736b643cbe3050e6121a7c9385803d5a82a7112c0df93b73d3ccc57a35d7fa','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-03 22:18:40',NULL,NULL,'false'),(1504,'other','',NULL,'Richard ','Pryor','dummyemail@5b2e9b365358dec69be285f186e475aaade4c1f9cc8618dc3b782597bc955660a6a87fd3','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-03 22:19:38',NULL,NULL,'false'),(1505,'other','',NULL,'Billy ','Crystal','dummyemail@802d783d4c77780a789ce093d30a6c86982c065566b31b483fffa27fec2de58d0ce1fd39','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-03 22:21:45',NULL,NULL,'false'),(1506,'other','',NULL,'Willem ','DeFoe','dummyemail@286d0b716bb8edfdadc88cb56245fe7edb2fcefca8e3484b5ba6c0859931906dd19fa434','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-03 22:22:04',NULL,NULL,'false'),(1507,'other','',NULL,'Sammy ','Davis Jr','dummyemail@d5eebdafc91fd6d11cf36be96d0aa9c0a9eb6cb00b63632176b6c0b1ee05f8c2ff410220','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-03 22:22:32',NULL,NULL,'false'),(1508,'other','aceto@buffalo.edu','','Ann','Reinking ','dummyemail@7e62083a77ccf560c287ce5754bc9d5608c89b2cf08428198666e320b0126b58c2617dd0','deceased','1949-11-10','2020-12-12','Actor,Choreographer,Dancer,Other','Prefer not to answer','female','','Singer','','','','Seattle, Washington','','United States of America','','One of seven children, Ann Reinking (1949-2020) grew up in Seattle, Washington.  She was in the sixth grade when she first saw a classmate dance.  She started ballet lessons and persuaded her parents to install a barre in her room so that she could practice at home.\r\n\r\nThe work paid off.  As a teenager, she won a Ford Foundation scholarship to study at the San Francisco Ballet School as well as scholarships to study with Robert Joffrey for two consecutive summers.  Upon completing high school, she moved to New York where her first job was with the corps de ballet at Radio City Music Hall.\r\n\r\nReinking went on to Broadway, films and television, earning numerous accolades for her work including Tony nominations for her leading performances in Dancin’ and as best actress in Goodtime Charley with Joel Grey.  Her astonishing number of awards includes the Theatre World Award for the work as Maggie in Over Here and the Clarence Derwent Award.  In 1997, Reinking won the Tony Award, the Drama Desk Award, the Outer Critics Circle Award and the Astaire Award for her choreography for the ENCORE production of Chicago, followed by a Tony Award to Fosse, which won for best musical.\r\n\r\nHer film debut was as Troubles Moran in Movie, Movie directed by Stanley Donen.  She then starred in All That Jazz directed by Bob Fosse, Annie directed by John Huston and in Blake Edwards’ Micki and Maude.  Clearly, great directors like working with great talent.\r\n\r\nReinking divided her time between family in New York and Tampa where she is Artistic Director of the Broadway Theatre Project, a program that brings together working professionals with gifted young people.  “Musical theatre is an American art form which must be kept alive,” said Reinking.\r\n\r\nCredits included TV commercials; original ballets:  Ritmo y Ruido for Ballet Hispanico, Legends for the Joffrey Ballet of Chicago and Suite Kander for Missouri State Ballet.  Choreography credits include Bye Bye Birdie with Jason Alexander-ABC-TV; national tour of the revival of 