e9cd65924c474f7dfef77','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-04 22:01:10',NULL,NULL,'false'),(1532,'artist','gina.hochstall@gmail.com','','Gina','Hoch-Stall','gina.hochstall@gmail.com','living','1987-02-03',NULL,'Choreographer,Dancer','Caucasian or White','female','','','','Chicago','IL','','United States of America','United States of America','','Described by Thinkingdance.net as ‘One of [Philadelphia]’s strongest dancers,’ Gina Hoch-Stall is a choreographic deviser and movement-based artist who served as the Artistic Director of RealLivePeople, a contemporary dance theater company, for nine years. Her work has been performed, often by her, up and down the East Coast, in Chicago and across Europe. RLP has received support from the Philadelphia Cultural Fund, Pennsylvania Partners in the Arts, The Puffin Foundation, The Fels Foundation, The Ohio State University, as well as residencies through White Pines Productions and the Philadelphia Dance Academy. Gina earned her MFA in Dance from The Ohio State University on a Dean\'s Distinguished three-year fellowship. She has taught her pedagogically progressive contemporary technique, improvisation, contact improvisation, and Mary Overlie\'s Viewpoints Method at multiple universities and studio spaces across the United States and in Germany and is a lecturer at Loyola University at Chicago. In addition, Gina serves as a dramaturg for other choreographers, facilitates difficult conversations, organizes for a better field, and works with clients as an Embodiment Coach.','upload/photo_upload_data/1638733902headshot_handonchest_cropped.jpg','',100,'115,30,31,117','Dance Theatre','2021-12-05 15:03:33','2021-12-05 15:03:33',NULL,'false'),(1533,'other','dummyhiddenemail',NULL,'Sarita','Smith Childs','dummyemail@7985f5bd4b25b6d86530aa84ae2252b16daddd26606fb8bf90bd5d39a1877380f7060a52','',NULL,NULL,'','','','','','','','','','','','','','','',0,',65',NULL,'2021-12-05 14:53:05',NULL,NULL,'false