db6583f994e0dff00eb8f9a1cc33d7947c00300278065f2f1c2717d08b48505','',NULL,NULL,'','','','','','','','','','','','','','','',0,',117',NULL,'2021-12-05 15:03:17',NULL,NULL,'false'),(1551,'other','aceto@buffalo.edu','','Debbie ','Allen ','dummyemail@c0d237569d23e0c4feaaa8a9c82d6e21d362552678809cb2e6ea4bf6af152e4c8e543181','living','1950-01-16',NULL,'Actor,Choreographer,Dancer,Other','African American or Black','female','','singer-songwriter, director, producer','','','','','United States of America','United States of America','','In a career that spans three decades, the name Debbie Allen is synonymous with dynamic energy, creative talent and innovation. For her vast body of work, Ms. Allen has earned three Emmy Awards, a Golden Globe, five NAACP Image Awards, a Drama Desk, an Astaire Award (for Best Dancer), and the Olivier Award. She holds four honorary Doctorate degrees and has a star on the Hollywood Walk of Fame. She was appointed by President George W. Bush to represent the United States as a Cultural Ambassador of Dance. She has been artist in residence at the Kennedy Center for over 15 years, creating original works with the legendary Arturo Sandoval and James Ingram, such as: Pepito’s Story, Brothers of the Knight, Dreams, Alex in Wonderland, Soul Possessed, Pearl, Dancing in the Wings and Oman O Man. Her long list of directing and producing credits include television classics such as FAME, Grey’s Anatomy, Scandal, How To Get Away With Murder, Jane the Virgin, Empire, A Different World, Everybody Hates Chris, Stompin’ At The Savoy, Polly, That’s So Raven, Cool Women, Quantum Leap, The Fantasia Barrino Story, and on stage, Cat on a Hot Tin Roof. She is currently an Executive Producer as well as a director and actress on ABC\'s Grey’s Anatomy.','upload/photo_upload_data/1639189016picture-blank.png','',100,'14,31,53,65','','2021-12-10 21:35:27','2021-12-10 21:35:27','Biography: https://www.debbieallendanceacademy.com/debbie-allen\nLineal Artists: http://www.dancei