701dc3d3b94','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-10 23:51:53',NULL,NULL,'false'),(1592,'other','',NULL,'Woody ','Guthrie','dummyemail@893fe1ae1871c147bec7f834132ef0da25f16243f6a9d5a2f442e1f6bd8f12202c8df3ad','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-10 23:54:25',NULL,NULL,'false'),(1593,'other','',NULL,'Blanche ','Talmud','dummyemail@15201bea016f96d45e7a2cdc127d7234e1f9b28c5a647220e03ed033b90fdbd5404bd7ec','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-10 23:54:58',NULL,NULL,'false'),(1594,'other','aceto@buffalo.edu','','Tommy ','Tune ','dummyemail@629f7dcc7d6514dc2c1987a07d96b024fa1ff976a503d285d9b5e6ac4cba223550d61c74','living','1939-02-28',NULL,'Actor,Choreographer,Dancer,Other','Caucasian or White','male','','Singer, Director, Producer','','','','','United States of America','United States of America','','Tommy Tune is one of the country’s most prolific performer/director/choreographers and is celebrating his golden decade on the great American stage. He has received 10 Tony Awards, which includes the 2015 Tony for Life Achievement in the Theatre and the only person in theatrical history to win in four different categories and to win the same two Tony Awards two years in a row. Tommy has also received The National Medal of Arts, 8 Drama Desk Awards, 2 Obie Awards, 3 Astaire Awards, and multiple Life Time Achievement Awards including the Society of Directors and the Choreographers’ George Abbott Award.\r\n\r\nA native Texan, Mr. Tune began his career as a dancer in the Broadway shows Baker Street,  A Joyful Noise and How Now Dow Jones. He has received Tony Awards for The Will Rogers Follies (Direction and Choreography), Grand Hotel (Direction and Choreography), My One and Only (Actor in a Musical and Choreography) Nine (Direction), A Day in Hollywood/A Night in the Ukraine (Choreography) and Seesaw (Featured Actor in a Musical). Tune received two Tony nominations (Direction and Choreography) for The Best Little Whorehouse In Texas. Tommy has been has been invited to sing and dance for three United States Presidents, the Queen of England and the Royal Family of Monaco.\r\n\r\nFilm credits include Hello Dolly, The Boy Friend, and Mimi Bluette…fiore del mio giardino, and in 1999, he made his Las Vegas debut as the star of EFX at the MGM Grand Hotel.  Tune is the recipient of the National Medal Of Arts, the highest honor for artistic achievement given by the President of the United States, and he has been honored with his own star on the legendary Hollywood Walk of Fame and was inducted into The Theater Hall of Fame by Gwen Verdon.\r\n\r\nIn 2009 the New York Landmarks Conservancy designated Mr. Tune as a Living Landmark. In early 2015 Tune received rave reviews for his tap dancing and singing role in the Encores! production of Lady, Be Good! at New York City Center. In addition to touring with Chita Rivera in Chita & Tune, Tommy is also touring the country in his one-man show, Tommy Tune Tonight! ','upload/photo_upload_data/1639275035picture-blank.png','',100,'65,104','','2021-12-11 21:27:58','2021-12-11 21:27:58','Biography: http://www.tommytune.com/biography/\nLineal Artists: http://memory.loc.gov/diglib/ihas/loc.music.tdabio.180/default.html','false'),(1595,'other','',NULL,'Kit ','Andree','dummyemail@47a50ee86be604ca6e0c14421d4ce703c9ae421e654dc221c4daf8ee713baf909ac7dcb1','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 21:12:14',NULL,NULL,'false'),(1596,'other','',NULL,'Camille ','Hill','dummyemail@e18294910bd5403e2555b0c8c5a339f480605dbfd45e326241b617407f492b61c4d0c5a5','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 21:14:57',NULL,NULL,'false'),(1597,'other','',NULL,'Emma Mae ','Horn','dummyemail@e1aa4884fcab0b6cbfdffd3382af2c96b151282114139251b6559aa96dbc24b573840845','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 21:15: