755b3826410606069f8673c046da8279f6ed692a26c878','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 21:24:11',NULL,NULL,'false'),(1607,'other','dummyhiddenemail',NULL,'Mike ','Nichols','dummyemail@1142b6acb0c8d7838fbf2638844b934358939587cc878c7e55e613f7386d1a7d1360341d','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 21:25:53',NULL,NULL,'false'),(1608,'other','aceto@buffalo.edu','','Luigi-Eugene Louis ','Faccuito','dummyemail@1ed73667846c03cd453ed35cc1e2cb3642ec9c3ed238c8eb29854ca2d2cf5af23f98cc89','deceased','1925-03-20','2015-04-07','Choreographer,Dancer,Other','Prefer not to answer','male','','Teacher, Innovator','','','','Ohio','','United States of America','','Luigi was the innovator of the world’s first jazz dance technique.\r\n\r\nBorn Eugene Louis Faccuito in Steubenville, Ohio, Luigi was the eighth of eleven children of Italian immigrant parents Nicholas and Antonette (Savoia). With coaching from his brother Tony, Luigi grew up winning talent shows with his singing, dancing and limber acrobatic tricks. By his teens, he headlined as \"Steubenville\'s Own Bobby Breene\" (the male Shirley Temple), and became a novelty emcee in vaudeville theatres. He then toured America\'s heartland, singing with the Bernie Davis Orchestra, replacing Dean Martin.\r\n\r\nAfter serving in the U.S. Navy during WWII, Luigi returned home and was urged to move to Hollywood to pursue a movie musical career. After only two months living in Los Angeles, tragedy struck in a near fatal car accident. Doctors held little hope he would recover from a basal skull fracture and paralysis down one side of his body. From within a deep coma, an inner voice told Luigi, \"Never stop moving kid, if you stop you\'re dead.\" He eventually awoke to be told by doctors, \"you\'ll never walk again.\" With determination he proclaimed, \"I\'m going to dance.\"\r\n\r\nOn his own, Luigi started developing stretching exercises into a routine that helped him discover what had to be done to control his body. He learned to \"always put the body in the right position,\" to \"feel from the inside out.\" After a long year of trial and error, he regained enough strength and equilibrium to start dance classes again at Falcon Studios in Hollywood. Over a year later, Luigi, seen by a talent scout, was asked to audition for MGM\'s On The Town starring Gene Kelly and Frank Sinatra. Miraculously--as he was still working on overcoming his paralysis—he booked the job, which began an eight-year dance career in over 40 films, such as: An American in Paris, Annie Get Your Gun, Singin\' in the Rain, The Band Wagon and White Christmas. Choreographers Robert Alton and Gene Kelly became his mentors.\r\n\r\nDuring the long waiting periods on film sets, Luigi did his own exercises to make sure his body remained limber, and he would not ruin a take. Soon dancers were following him—ten or twenty at a time. Robert Alton encouraged Luigi saying, \"You\'ve got a great style, you should teach it.\" So in 1951, Luigi started his first jazz classes in L.A. He taught while working on films, live theatre, and TV variety shows such as, The Colgate Comedy Hour, and The Red Skelton Show. He never stopped moving!\r\n\r\nLuigi was taken to NYC to perform in the Broadway show Happy Hunting with Ethel Merman and Fernando Lama, and it was there that he later opened his school, The First World Jazz Centre. \"A good teacher knows how to prevent injuries,\" Luigi said. He stressed the importance of using the body properly, telling students to \"take your time - feel what you\'re doing.\" He also said, \"If you keep doing things right long enough, they\'ll get better right. But, if you keep doing things wrong long enough, they\'ll feel right -- wrong.\"','upload/photo_upload_data/1639277884picture-blank.png','',100,'1,65','','2021-12-11 22:15:38','2021-12-11 22:15:38','Biography: https://www.broadwaydancecenter.com/faculty/luigi\nLineal Artists: http://www.luigijazz.com/man.html','false'),(1609,'other','dummyhiddenemail',NULL,'Tony ','Facciuto','dummyemail@3c5fdd8bb43661daef301f657b5e1938043f0d0ca9bd4f3f8ee5fe6acca2f8b7af08f500','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 21:59:51',NULL,NULL,'false'),(1610,'other','dummyhiddenemail',NULL,'Edith','Jane','dummyemail@b6167cb3502451f01e01bfd4648571956116a6eb00d985b8384afadc256048cddeb2c05f','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 22:00:51',NULL,NULL,'false'),(1611,'other','dummyhiddenemail',NULL,'Ralph ','Faulkner','dummyemail@d69b49c703370e00293e6a233587346bf7c06fcdebf204f79ce58ac8345a599095519813','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 22:01:09',NULL,NULL,'false'),(1612,'other','',NULL,'Sam ','Mintz','dummyemail@1f51012e4564406b094687198545d8deeaae5d855c3b6c733aab048b50d703bf5d522126','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 22:01:42',NULL,NULL,'false'),(1613,'other','',NULL,'Micho ','Ito','dummyemail@fc39cdd2b4da7548f6c716b47a33b34cda1587ed50d6c4e5e6bcda4ec895b90d0e151e17','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 22:01:58',NULL,NULL,'false'),(1614,'other','',NULL,'Adolph ','Bolm','dummyemail@e5d670cee6c0b2fcd99f84c02ad7f0d0aa77ea4b177a75c7e4749d207c810b91145d77ef','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 22:02:51',NULL,NULL,'false'),(1615,'other','',NULL,'Bronislava ','Nijinska','dummyemail@dd621226230adc21e7f23aae9898caa32912847ef3f17c71adb9b56d20ad13cb10d1734d','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 22:03:06',NULL,NULL,'false'),(1616,'other','',NULL,'Michael ','Panaieff','dummyemail@206e9db0647b8e738160ce72afa3b0df7da0399ec88c4f9c6bc942624fbc14d1d354d300','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 22:03:23',NULL,NULL,'false'),(1617,'other','',NULL,'Edward ','Ca