amison ','dummyemail@c46e1323cfde40595639e652d30cbcccc89070f33c60ce66ba9c71734e9def2de4f05d94','living','1943-05-10',NULL,'Choreographer,Dancer','African American or Black','female','','','','','','','United States of America','United States of America','','Dancer and choreographer Judith Jamison was born on May 10, 1943 in Philadelphia, Pennsylvania to Tessie Brown Jamison and John Jamison, Sr. While encouraged by her parents to study the piano and violin, Jamison gravitated towards ballet. At the age of six, Jamison began taking lessons at the Judimar School of Dance in Philadelphia. She went on to study the techniques of African American dance pioneer Katherine Dunham. Jamison graduated from Germantown High School in Philadelphia, and enrolled at Fisk University in Nashville, Tennessee. However, she left Fisk to study dance and kinesiology at the Philadelphia Dance Academy, now part of New York City’s University of the Arts.\r\n\r\nIn 1964, Jamison earned critical acclaim for her work with choreographer Agnes de Mille and the American Ballet Theatre in New York. A year later, Alvin Ailey invited Jamison to join the Alvin Ailey American Dance Theater, where she was featured in numerous productions, toured with the company to Africa and Europe and earned international acclaim for her signature performance of Cry, a fifteen minute solo piece written by Ailey for Jamison. Jamison went on to appear as a guest performer with the San Francisco Ballet, the Swedish Royal Ballet, the Cullberg Ballet, and the Vienna State Ballet. In 1980, Jamison performed on Broadway in Duke Ellington’s Sophisticated Ladies with Gregory Hines. That same year, Jamison began her own work as a choreographer. She premiered her first ballet, Divining, with the Alvin Ailey American Dance Theater in 1984. In 1988, Jamison founded The Jamison Project Dance Company.\r\n\r\nJamison returned to the Alvin Ailey American Dance Theater in 1989, assuming the role of artistic director following the death of founder Alvin Ailey. In 1993, Jamison choreographed Hymn, a tribute to Ailey, and published her autobiography, Dancing Spirit. Under her leadership, the Alvin Ailey American Dance Theater joined forces with Fordham University to establish a joint bachelor of fine arts program with a multicultural dance curriculum. Jamison also spearheaded the construction of the company’s first permanent home, the Joan Weill Center for Dance. Although Jamison stepped down as artistic director in 2011, she remained associated with the Alvin Ailey American Dance Theater as artistic director emerita.','upload/photo_upload_data/1639280595picture-blank.png','',100,'4,14,31','','2021-12-11 22:54:08','2021-12-11 22:54:08','Biography: https://www.thehistorymakers.org/biography/judith-jamison\nLineal Artists: https://www.thirteen.org/freetodance/biographies/jamison.html','false'),(1635,'other','',NULL,'Agnes de ','Mille','dummyemail@65c86c3723bdb2ebae9916ad4e430d7cc15a8c814572404ec3a557cbdd748ced1ffcb604','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 22:45:05',NULL,NULL,'false'),(1636,'other','dummyhiddenemail',NULL,'Marion ','Cuyjet','dummyemail@9ebb2bc49a791bce5a225299f26aa46f6b65d82f04c5798f7909303ab97bc8d08a5f5f85','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 22:50:29',NULL,NULL,'false'),(1637,'other','dummyhiddenemail',NULL,'Delores ','Brown','dummyemail@40c174c764745921e18c51a45de25fb8165cee5ffcdd205be7f426a6136db0f8d36fb185','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 22:50:43',NULL,NULL,'false'),(1638,'other','dummyhiddenemail',NULL,'John ','Jones','dummyemail@3fcc53b9ba2822b2a3cb8b667eb0b7542f185d112b15a96f86a50100b8e709a3216a194e','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 22:51:04',NULL,NULL,'false'),(1639,'other','',NULL,'John ','Parks','dummyemail@35e9235275d278789ce109e0ec1a79ee210e7356f958059bdab1dcec4a4f54a8881939f7','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 22:52:51',NULL,NULL,'false'),(1640,'other','',NULL,'Ulysses ','Dove','dummyemail@ff86f60c251777f3df39077e2296c53540448555738189b5d21a2aa3432f75781f6dde13','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-11 22:53:24',NULL,NULL,'false'),(1641,'other','aceto@buffalo.edu','','Dwight ','Rhoden ','dummyemail@39f7bab4b14ed829d61094ad41bd52d53ee5530fbbd723543fba74230927595f51c424df','living','1962-04-03',NULL,'Choreographer,Dancer','Prefer not to answer','male','','','','','','','United States of America','United States of America','','Dwight Rhoden is a formidable name on the contemporary dance scene. First known as a dancer with the Alvin Ailey Company, he later distinguished himself as a choreographer whose high-energy compositions seem to express the tenor of the age. With star dancer Desmond Richardson, Rhoden founded a dance company called Complexions. This diversified group of dancers of many races and dance backgrounds has become a primary vehicle by which Rhoden offers his talent to the world, though he has received commissions from major dance companies throughout the United States. A complete auteur, Rhoden looks to all aspects of a performance, including the musical scores, set and costume designs, and lighting, to express to audiences his personal vision. For its powerful, passionate performances that center both on the strength of the human spirit and rejoice in diversity, the company has earned an international reputation. As the primary choreographer of Complexions, Rhoden has earned an international reputation as well.\r\nRhoden was born in 1962 and grew up in Dayton, Ohio. He had long been musical, playing the flute, clarinet and drums in high school, but until that time his dance experience was limited to the popular street dancing of the late 1970s. When a friend suggested he try studying at the Dayton Contemporary Dance Company, he found himself at age eighteen immersed in dance under the tutelage of the company’s founder Jeraldyne Blunden, whom he described as a “tremendous mentor.” “I went over to Dayton, and that was it. I was hooked,” he recalled to Denver Post’s Glenn Giffin. Rhoden was a hard worker and fast learner, teaching his body to perform intricate maneuvers with style. After dancing for six years with the Dayton company, Rhoden left to join the Les Ballets Jazz de Montreal, where he spent a four-year stint.\r\n\r\nRhoden auditioned three times for the Alvin Ailey American Dance Theatre, before he was asked to join the company. “Dwight started in the company around 1986,” Judith Jamison remembered to Barbara Hoover of the Detroit News. “I loved the way he dances. He was the oddest and most wonderful, strange creature on stage.” After a time, Rhoden appeared in many leading roles with the company, alternating in these with dancer Desmond Richardson, with whom he became friends. Yet while Richardson thrived on dancing, more and more, Rhoden found he preferred choreography, especially as his body began to age.\r\nIn 1991 Judith Jamison, an Ailey company dancer who became artistic director in 1989 after Ailey’s death, commissioned Rhoden’s first work for the main company. Rhoden would continue to dance and choreograph for the Alvin Ailey company for the next three years. Then, in 1994, Rhoden wanted to strike out on his own. So, with Richardson, he left the Ailey company to found their own company, Complexions, for which Rhoden would choreograph some thirty works over the next decade. The troupe bills itself as more than a nod to the deliberate diversity of the dancers. “Our company is extremely diverse, Asian, Spanish, redheads with freckles, black—it runs the gamut,” Rhoden told Diane Haithman of the Los Angeles Times. “When we perform all over the world,','upload/photo_upload_data/1639788980picture-blank.png','',100,'14,31','Street dancing','2021-12-17 20:02:57','2021-12-17 20:02:57','Biography: https://www.encyclopedia.com/education/news-wires-white-papers-and-books/rhoden-dwight-1962','false'),(1642,'other','dummyhiddenemail',NULL,'Desmond ','Richardson','dummyemail@58ba2d198c95b8b7da06af20c85840ef8b3a559072cb6829f040fd54aee8fae5d3c3d417','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-17 19:57:45',NULL,NULL,'false'),(1643,'other','dummyhiddenemail',NULL,'Jeraldyne ','Blunden','dummyemail@d4f65e6a5e93c521610b49546a3f8f585cd44ce88d320332fcb5806269d8bdb51ff6811a','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-17 19:58:35',NULL,NULL,'false'),(1644,'other','aceto@buffalo.edu','','Garth ','Fagan','dummyemail@b6ee11b55be4c882122910ceb1b6c949ff1ee2841e8f88c73fdbf289775f8abc33502b3f','living','1940-05-03',NULL,'Choreographer,Dancer','Prefer not to answer','male','','','','','','','United States of America','Jamaica','','Choreographer Garth Fagan was born on May 3, 1940 in Kingston, Jamaica to Louise Walker and S.W. Fagan, a chief education officer of Jamaica. As a teenager, Fagan studied dance with Ivy Baxter and the Jamaica National Dance Company. He attended Excelsior High School in St. Andrews, Jamaica, and performed at the inauguration ceremony for Cuban President Fidel Castro in 1959. After moving to Detroit, Michigan in 1960, Fagan danced with the Detroit Contemporary Dance Company and the Dance Theater of Detroit, where he studied with Jose Limon, Mary Hinkson, Alvin Ailey, Lavinia Williams, and Katherine Dunham. In 1968, Fagan received his B.A. degree from Wayne State University in Detroit, Michigan. He later earned his D.F.A. degree from the University of Rochester in 1986.\r\n\r\nUpon graduating from Wayne State University, Fagan moved to Rochester, New York, where he was hired as a dance teacher and choreographer at the educational opportunities center. In 1969, Fagan began teaching at SUNY Brockport; and in 1970, he founded his own dance company, originally called The Bottom of the Bucket, But…Dance Theater. The name was later changed to Garth Fagan Dance. Fagan produced a number of successful pieces through his dance company, including From Before in 1978, Prelude in 1981, and Never Top 40 (Jukebox) in 1985. Fagan choreographed the first fully staged production of the Duke Ellington street opera, Queenie Pie, in 1986. He then opened the Garth Fagan Dance School in 1990. The following year, Fagan collaborated with musician Wynton Marsalis and sculptor Martin Puryear for the production of Griot New York. In 1997, Fagan became the choreographer of the Broadway musical production of The Lion King, for which he won a Tony Award for best choreography. Over the next two decades, Fagan continued to choreograph notable pieces like Trips and Trysts in 2000, ING in 2004, and Mudan 175/39, which was named by The New York Times as the third of the top six dance watching moments of 2009. He also developed the Fagan Technique, a unique and evolving vocabulary, which fuses the weight of modern dance, the vitality of Afro-Caribbean movement, and the speed and precision of ballet with the risk-taking experimentation of post modernism.\r\n\r\nFagan received numerous awards and honors for his choreography. In addition to his Tony Award for his work in The Lion King, Fagan also received a Laurence Olivier award for Best theater Choroegrapher in 2000, Drama Desk Award for Outstanding Choreography, and an Outer Critics Circle Award for Best Choreography for the production. In 1998, Fagan was awarded a Guggenheim Fellowship and a Choreography Fellowship from the National Endowment for the Arts. Fagan was honored with the Samuel H. Scripps American Dance Festival Lifetime Achievement Award in 2001; and in 2012, Dance Heritage Collection named Fagan among “America’s 100 Irreplaceable Dance Treasures.” Fagan received honorary degrees from Juilliard School, Hobart College, William Smith College, and Nazareth College. In 2017, Fagan received a Lifetime Achievement Award from the American Dance Guild.','upload/photo_upload_data/1639790078picture-blank.png','',100,'31','','2021-12-17 20:22:48','2021-12-17 20:22:48','Biography: https://www.thehistorymakers.org/biography/garth-fagan','false'),(1645,'other','dummyhiddenemail',NULL,'Ivy ','Baxter','dummyemail@d84890f77bd3af38700fb82f06d242a71bf0785f28114a67aaa799e8c854ab26c382f18f','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-17 20:17:22',NULL,NULL,'false'),(1646,'other','',NULL,'Mary ','Hinkson','dummyemail@15a8c058d57e6256704011d2be5b096d255982dd9ced82f85e9291df36e8b136726467ab','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-17 20:18:09',NULL,NULL,'false'),(1647,'other','',NULL,'Lavinia ','Williams','dummyemail@00c98ae0e98e9ffc814a5a8589bc16881b34af612ba4adf49fed4322e61859229718d25f','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-17 20:18:41',NULL,NULL,'false'),(1648,'other','aceto@buffalo.edu','','Lar ','Lubovitch ','dummyemail@18fdcd0b6ce090263efdab2c1f1db8df0933299adc3fcaec9286b0702d3a7d7ee0cf3ce2','living','1943-04-09',NULL,'Choreographer,Dancer','Prefer not to answer','male','','','','','','','United States of America','United States of America','','Born in Chicago in 1943, Lar Lubovitch began his dance education at The Juilliard School in NYC in 1962 where his teachers were Martha Graham, José Limón, Anthony Tudor, and Donald McKayle, in whose company Lubovitch subsequently began his professional career. \r\n\r\nIn 1968 after performing in numerous modern, ballet and jazz companies, he created the Lar Lubovitch Dance Company, now in its 48th season. For his company he has choreographed over 100 dances, celebrated for their musicality, humanity and rhapsodic style. Called “a national treasure” by Variety and named “one of the ten best choreographers” by the New York Times, over the years Lubovitch and the company have appeared in almost every state in the US and toured internationally. Lubovitch has been the recipient of numerous National Endowment awards, including several “masterpiece grants” for the reconstruction of seminal works.\r\nHis dances have also appeared in the repertoire’s of major dance companies throughout the world including American Ballet Theatre, San Francisco Ballet, Paris Opera Ballet, Royal Danish Ballet, Alvin Ailey American Dance Theater, New York City Ballet, The Joffrey Ballet, Martha Graham Dance Company, and many others.  His “Othello, A Dance in Three Acts” (1997), a co-production of American Ballet Theatre and San Francisco Ballet, was broadcast on PBS Great Performances and nominated for an Emmy award. His dances on film include “Fandango,” also broadcast on PBS (International Emmy Award), and “My Funny Valentine,” for the Robert Altman film “The Company” (American Choreography Award).\r\nLubovitch has also made a notable contribution in the field of ice dancing with dances for Olympians John Curry, Peggy Fleming, Dorothy Hamill, and in subsequent years for Paul Wylie, Brian Orser and others. For Anglia Television in Great Britain, he created a full-length ice-dance special, “The Sleeping Beauty,” which was also broadcast on PBS, and for the A&E network, he created “The Planets,” starring Olympic ice dancers Paul and Isabelle Duchesnay (nominated for an International Emmy, Cable Ace and Grammy awards.) In 2004, he was honored by the Ice Theater of New York, with an award for his contribution to the advancement of ice dancing.\r\n\r\nLubovitch made his Broadway debut in 1987 with choreography for Stephen Sondheim’s “Into the Woods” for which he received a Tony nomination. In 1993, he received the Astaire Award from the Theatre Development Fund for his dances in “The Red Shoes.”  In 1996, he created new dances for the Tony Award winning revival of “The King and I” and, in 2002, the choreography for Disney’s “The Hunchback of Notre Dame” in Berlin, Germany.\r\nIn 2007, Lubovitch created the Chicago Dancing Festival, launched in collaboration with the City of Chicago and the Museum of Contemporary Art which, now in its tenth season, includes five days of performances taking place in four major theatres in downtown Chicago, featuring a national roster of leading American dance companies. The festival is seen every August by an audience of 15,000 people and is presented entirely free to the public. In 2007, he was named Chicagoan of the Year by the Chicago Herald Tribune, and in 2008 by Chicago Magazine.\r\nIn 2011, he was named a Ford Fellow by United States Artists and also received the Dance/USA Honors Award. In 2012, he was awarded the Prix Benois de la Danse for outstanding choreography at the Bolshoi Theatre in Moscow. In 2013, the American Dance Guild honored him for lifetime achievements and in 2014, he was awarded an honorary doctorate by The Juilliard School in New York City. In May of 2016, he premiered a new dance based on the Pushkin poem, “The Bronze Horseman,” at the Mikhailovsky Ballet in Saint Petersburg, Russia.  In July of 2016, he received the American Dance Festival/Scripps Award for Lifetime Achievement.','upload/photo_upload_data/1639791376picture-blank.png','',100,'14,31,65','','2021-12-17 20:42:15','2021-12-17 20:42:15','Biography: https://dance.arts.uci.edu/lar-lubovitch','false'),(1649,'other','',NULL,'José ','Limón','dummyemail@1772a0003c1901cd3d03d89e74da709c6d3d17edfccb673d1b1ceb0e1fa392c73c4547b3','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-17 20:37:37',NULL,NULL,'false'),(1650,'other','',NULL,'Anthony ','Tudor','dummyemail@6b7807ab83c8e92c6a2e8fde0767ff7dd8674da4c96b23a60a2a3cb6c4e44bcf8254f2ba','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-17 20:37:58',NULL,NULL,'false'),(1651,'other','',NULL,'Donald ','McKayle','dummyemail@8934be38e3d9d44435aea71a0f008fa7d2d8eae25b586f74fa2c99f8120ae0372715e99b','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-17 20:38:50',NULL,NULL,'false'),(1652,'other','dummyhiddenemail',NULL,'John ','Curry','dummyemail@2f20476cf391aa3aef92d0cd0a5516611fdf9da57995341b6993fbcfa1ef405ed67fdf4f','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-17 20:39:42',NULL,NULL,'false'),(1653,'other','dummyhiddenemail',NULL,'Peggy ','Fleming','dummyemail@74abf41010d7195b1916b7f99c26d30846c9148bd6d496d763c259b74627be9a92b8ba5c','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-17 20:40:01',NULL,NULL,'false'),(1654,'other','dummyhiddenemail',NULL,'Dorothy ','Hamill','dummyemail@da8e145f1e5ee4dcf02db1053bae93ffb28e51cd88cf1286471bd2dd7012d6bd134313dc','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-17 20:40:17',NULL,NULL,'false'),(1655,'other','dummyhiddenemail',NULL,'Paul ','Wylie','dummyemail@8d5d8cb34e013ef01926837e1ce3abac7a09a8243cea243ed5b98947fe368b3ddd187f5b','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-17 20:40:36',NULL,NULL,'false'),(1656,'other','dummyhiddenemail',NULL,'Brian ','Orser','dummyemail@6fe0dbdd27afc7f5be328ed5925a224932db0fe2d0367af1ae6559601479e18d26c4b1d4','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-17 20:40:54',NULL,NULL,'false'),(1657,'other','dummyhiddenemail',NULL,'Stephen ','Sondheim’','dummyemail@784c11b686fc9c8e5bc675a14017f96e4de54c49a2e68bf3a3b1428c6b1a6aebade57a7a','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-17 20:41:45',NULL,NULL,'false'),(1658,'other','aceto@buffalo.edu','','Murray ','Louis ','dummyemail@61fb5746cd3ea972acc44374f50eb5da4546b399c67f2de967982e83947fdebbaa68508b','deceased','1926-11-04','2016-02-01','Choreographer,Dancer','Prefer not to answer','male','','','','','','New York','','United States of America','','Born Brooklyn, New York, 1926. Died New York City, New York, February 1, 2016.\r\nMurray Louis, a student of Alwin Nikolais, can be considered a third-generation disciple of Mary Wigman. Beginning in 1951, Louis was a principal dancer in Nikolais’s company. While he continued to maintain a close association with Nikolais throughout his life, Louis began to choreograph independently and later formed his own company. As a dancer, Louis was known for his mercurial virtuosity and his choreography reflects this proclivity. His work is witty, physically demanding, idiosyncratic and energetic. Louis seeks to evoke the senses and to create images that provide the viewer with a path connecting his material, physical world to the spiritual realm. He has created over one hundred works, toured five continents, and performed in every state in the U.S. A variety of composers have created music for him and he also has choreographed to the music of Bach, Brahms, Schubert, Stravinsky, and Tchaikovsky, among others. Louis has created dances for the Royal Danish Ballet, The José Limón Company, The Hamburg Opera Ballet, The Scottish Ballet, The Berlin Opera Ballet, The Cleveland Ballet, and for smaller companies in the U.S. and Canada. Louis also is considered one of the finest dance teachers, offering his students a rare insight into the theory and practice of the art. He also has written a collection of essays, Inside Dance, which was published by St. Martin’s Press, and a film series, Dance as an Art Form, which has become a standard introductory series for art education programs in the U.S.','upload/photo_upload_data/1639796994picture-blank.png','',100,'31','','2021-12-18 19:10:34','2021-12-18 19:10:34','Biography: https://dance.washington.edu/people/murray-louis\nLineal Artists: https://en.wikipedia.org/wiki/Murray_Louis','false'),(1659,'other','dummyhiddenemail',NULL,' Ethel','Louis','dummyemail@2d5a64573431f668ceea36fcd62dd1e16d97b8a4aa45a866c3f205532b7671a96b574ff7','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 19:05:44',NULL,NULL,'false'),(1660,'other','dummyhiddenemail',NULL,'Hanya ','Holm','dummyemail@76c19ad4ad94c9872a7af58440db9941926c4ac4e0b3f97b1c9ca8725889ef93644bfd28','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 19:06:38',NULL,NULL,'false'),(1661,'other','dummyhiddenemail',NULL,' Alwin ','Nikolais','dummyemail@aea67b8d737cd1b582c5b10ded57bbd70b3afec223c5fb013ebb01f0f17b73d08fff0933','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 19:07:25',NULL,NULL,'false'),(1662,'other','dummyhiddenemail',NULL,'Rudolph ','Nureyev','dummyemail@1a8870ad30f285f722f7022b699b22f549b2f88a8a35b3b70ee8787f315b1ea8dfbe7fd3','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 19:08:24',NULL,NULL,'false'),(1663,'other','aceto@buffalo.edu','','Bill T. ','Jones ','dummyemail@c6107846f7a6b3926f40e4acd1d27c45e9adeb01d0c9e340fec992f8720947c2f49cdb4f','living','1952-02-15',NULL,'Choreographer,Dancer,Other','Prefer not to answer','male','','Director, Author','','','','','United States of America','United States of America','','Dancer and choreographer Bill T. Jones was born on February 15, 1952 in Bunnell, Florida. He was the tenth of twelve children born to Estella Jones and Augustus Jones, both migrant farmers. At the age of twelve, Jones’ family moved to Wayland County in upstate New York. After graduating from Wayland High School, Jones enrolled at the State University of New York (SUNY) at Binghamton where he studied dance and participated in track and field.\r\n\r\nIn 1971, Jones met Arnie Zane, a photographer, who helped him discover his destiny as a dancer. Jones and Zane joined with one of their professors, Lois Welk, to form the American Dance Asylum (ADA). Their work with the ADA eventually led to Jones’ solo debut with the Dance Theatre Workshop’s Choreographers’ Showcase in 1977. During the next few years, Jones and Zane performed internationally. In 1982, Jones and Zane formed the Bill T. Jones/Arnie Zane Dance Company. Although the dance troupe met with great success, Zane took ill in 1984; and, in 1988, he died of AIDS-related lymphoma. Jones continued to work with the troupe and created personal works that allowed him to express his grief. One such work, “Absence,” made its debut in 1989. In 1990, the troupe premiered another work inspired by Zane, “Last Supper at Uncle Tom’s Cabin.”\r\n\r\nIn addition to creating more than 140 works for his own company, Jones has been commissioned to create dances for several modern and ballet companies, including Alvin Ailey American Dance Theater, Boston Ballet, Lyon Opera Ballet, and Berlin Opera Ballet, among others. Jones directed and performed in a collaborative work with Toni Morrison and Max Roach, “Degga” (1995), at Alice Tully Hall, which was commissioned by the Lincoln Center’s Serious Fun Festival. His collaboration with Jessye Norman, “How! Do! We! Do!” (1999), premiered at New York’s City Center. In 2010, Jones was named executive artistic director of New York Live Arts, a company formed by a merger of the Bill T. Jones/Arnie Zane Dance Company and Dance Theater Workshop.\r\n\r\nJones’ work has been recognized with the 2010 Jacob’s Pillow Dance Award; the 2005 Wexner Prize; the 2005 Samuel H. Scripps American Dance Festival Award for Lifetime Achievement; the 2003 Dorothy and Lillian Gish Prize; and the 1993 Dance Magazine Award. Jones has also received Honorary Doctorate Degrees from Yale University, the Art Institute of Chicago, Bard College, Columbia College, Skidmore College, the Juilliard School, and Swarthmore College. He is a recipient of the State University of New York at Binghamton Distinguished Alumni Award.','upload/photo_upload_data/1639873457picture-blank.png','',100,'14,31','','2021-12-18 19:34:44','2021-12-18 19:34:44','Biography: https://www.thehistorymakers.org/biography/bill-t-jones\nLineal Artists: https://elisa-rolle.livejournal.com/2678987.html','false'),(1664,'other','dummyhiddenemail',NULL,'Arnie ','Zane','dummyemail@467d3a0aea521c9b469380fabf7f135847bfaa0cf42bb4254d1c2ea0b5584130353c6760','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 19:25:55',NULL,NULL,'false'),(1665,'other','dummyhiddenemail',NULL,'Toni ','Morrison','dummyemail@72af1b1220facd657c0d2fdc5f7122853d3b07cfa300de2478313e5b2bf23379693aff6d','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 19:26:27',NULL,NULL,'false'),(1666,'other','dummyhiddenemail',NULL,'Max ','Roach','dummyemail@3ea2fd5a586457566e38efa57f0b1566fe9f60fc582b8486ea6df6488ba60472e67d995a','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 19:26:51',NULL,NULL,'false'),(1667,'other','dummyhiddenemail',NULL,'Jessye ','Norman','dummyemail@bbad3a48f86d4dddeba64a5f94a90513cedb1846de270ae4fb6c0ce084efbe70bc1d9256','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 19:27:20',NULL,NULL,'false'),(1668,'other','dummyhiddenemail',NULL,'Bjorn ','Amelan','dummyemail@3caeb108e9a447e402e64a093640de0fca1e287991407208722823f5425211b2ce90d970','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 19:28:26',NULL,NULL,'false'),(1669,'other','dummyhiddenemail',NULL,'Rhodessa ','Jones','dummyemail@fdd778cabd7b5574b40f84d75ac0cbb67c8b640521f5ef48bd7bf732d53e2e556bbb5fe7','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 19:30:05',NULL,NULL,'false'),(1670,'other','dummyhiddenemail',NULL,'Keith ','Haring','dummyemail@c19d50ae81af1d4b65cf4f47c4303e4d67d391e7610c541020e626a1c87f042402813290','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 19:30:36',NULL,NULL,'false'),(1671,'other','dummyhiddenemail',NULL,'Lois ','Welk','dummyemail@97f7440504aa4f6f5281b941da113eb412476bb2a7e7a5214c33f39fea9537bfa56a3397','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 19:33:00',NULL,NULL,'false'),(1672,'other','aceto@buffalo.edu','','Rennie ','Harris ','dummyemail@b5885800b7f992811c6f6903b4609395f6c04c4740c71170dcb2f81904d54bbe5f773e92','living','1964-01-28',NULL,'Choreographer,Dancer,Other','Prefer not to answer','male','','Educator, Artistic Director','','','','','United States of America','United States of America','upload/biography_upload_data/1639874705Rennie Harris.pdf','','upload/photo_upload_data/1639874725picture-blank.png','',100,'53','','2021-12-18 19:51:10','2021-12-18 19:51:10','Biography: http://www.rennieharrisrhaw.org/rennie.php','false'),(1673,'other','dummyhiddenemail',NULL,'Don ','Campbell','dummyemail@ddb0f109c52412da651c89bda45c4a28eb5ab2eb0c1e1746042612dbac7ae863b205d3ad','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 19:48:05',NULL,NULL,'false'),(1674,'other','aceto@buffalo.edu','','Cholly  ','Atkins','dummyemail@c8ddb56806624b1248d57ce362b3e1a302cb709d21a6325dca0ebba0290713d9bbd04410','deceased','1913-09-30','2003-04-19','Choreographer,Dancer','Prefer not to answer','male','','','','','','Alabama','','United States of America','','Cholly Atkins, born Charles Atkinson in Pratt City, Alabama, was a tap and jazz dancer/choreographer best known for his contributions as the house choreographer and coach for Motown dancing vocal groups from 1965 to 1971. Atkins was responsible for creating the synchronized classic jazz and rhythm-tap (minus the taps) routines for groups including Gladys Knight and the Pips, The Supremes, and The Temptations. To create his choreographic style, Atkins drew from vernacular dances such as the Charleston, Suzy-Z, and his early experiences choreographing chorus line routines on the Vaudeville circuit. His precise, choreographic style enabled Motown singers to perform synchronized, lyric-specific dance breaks and have enough breath left to continue singing.\r\n\r\nBefore his years with Motown, Atkins’ best-known contribution to tap dancing was his partnership with legendary tap dancer Honi Coles from the 1940s through the 1960s. Together, they created “Class Act,” a dance routine that emerged out of the soft shoe and evolved into the duo’s trademark style of precise, polished tap dance routines. Atkins and Cole performed at the Cotton Club and appeared with the big bands of Cab Calloway, Count Basie, Louis Armstrong, Lionel Hampton and Billy Eckstine. Atkins and Cole performed their show-stopping choreography in the Broadway musical Gentlemen Prefer Blondes, which ran between 1949 and 1953.\r\n\r\nThe decline of tap dance popularity began around 1944 with the advent of ballet choreography in Broadway shows and Hollywood films. In 1954, due to the lack of performing work available, Atkins became head of the tap department at the Katherine Dunham School of Arts and Research in New York City.  In 1988, tap dancer Dianne Walker convinced Atkins to participate in the Broadway show Black and Blue. Atkins had not tapped since 1965 but agreed to redo three soft-shoe numbers titled “Memories of You,” “After You’ve Gone,” and “I’m Confessin” for the production. Atkins’ choreography in Black and Blue won a Tony Award for Best Choreography in 1989. That same year he was asked to develop Motown-style choreography for the teen group New Kids on the Block.\r\n\r\nCholly Atkins built the Motown dancing look of the 1960s, but more importantly he reshaped popular vernacular dances into performing acts that transcended the test of time. The smooth, polished look recognizable in rock and roll stage acts today are direct descendants of the aesthetic look and choreographic methods of Cholly Atkins.\r\n\r\nCholly Atkins died in 2003 at the age of 89 in Las Vegas.','upload/photo_upload_data/1639877611picture-blank.png','',100,'65,104','','2021-12-18 20:53:22','2021-12-18 20:53:22','Biography: https://www.blackpast.org/african-american-history/atkins-cholly-1913-2003/\nLineal Artists: http://memory.loc.gov/diglib/ihas/loc.music.tdabio.17/default.html','false'),(1675,'other','dummyhiddenemail',NULL,'Honi ','Coles','dummyemail@dfc70518a69fe831d881a87960bef922299df5b9d6295d7a3da9cce9459423c3f6b0e12a','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 20:38:38',NULL,NULL,'false'),(1676,'other','dummyhiddenemail',NULL,'Cab ','Calloway','dummyemail@5b2f7062cd5ee75439b558b7441591a2766a84d722814796b84396e575ed5348e8537f13','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 20:39:33',NULL,NULL,'false'),(1677,'other','dummyhiddenemail',NULL,'Louis ','Armstrong','dummyemail@5980bd978cbd4d098c07363216f91d4684f83d5983a2b8f5b5d6ac6e7fbb6eb9f47dbbe0','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 20:39:53',NULL,NULL,'false'),(1678,'other','dummyhiddenemail',NULL,'Lionel ','Hampton','dummyemail@dec462bfb1c71fc797d5209c12b13604ef14804a2c481ef49ba16d171cd02e02f0c2c056','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 20:40:16',NULL,NULL,'false'),(1679,'other','dummyhiddenemail',NULL,'Billy ','Eckstine','dummyemail@c38e544240f0fb81e90f48c4face4382913e8836aee0c5503219ad377bb3ee772af51d78','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 20:40:35',NULL,NULL,'false'),(1680,'other','dummyhiddenemail',NULL,'Charlie ','Barnet','dummyemail@55ed9dbc7d10373fc3ff96e4988d04ba2efffc76d727a60858b2204fa083063358cd52c1','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 20:42:56',NULL,NULL,'false'),(1681,'other','dummyhiddenemail',NULL,'William James \"Count\" ','Basie','dummyemail@531ac6fa11317730081987de3c9bb59a1d9577e511740c94026c6883416c2f93e7488014','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 20:43:31',NULL,NULL,'false'),(1682,'other','dummyhiddenemail',NULL,' Berry ','Gordy','dummyemail@b91fb544cf8d48d50b940e2ffb3e5d33a5f25d33f884f399ee70ba9b1a4d5920260b0c46','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 20:44:06',NULL,NULL,'false'),(1683,'other','dummyhiddenemail',NULL,'William ','Porter','dummyemail@2127b4d6a7fede33d72c22abbe1a487bfe643639b20ada19d06704e54787bf1aca648bf0','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 20:46:50',NULL,NULL,'false'),(1684,'other','dummyhiddenemail',NULL,' Katherine ','Davis','dummyemail@25803e63ae03535b1e2260c1db7d9b9dd2ce965dec03216b610c27b5f45f270f444c8992','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 20:48:58',NULL,NULL,'false'),(1685,'other','dummyhiddenemail',NULL,'Dotty ','Saulters','dummyemail@90ea00aae5c40c339944fa8cc2c2162e25a2614f74dbc1ddd651834d94aafce837e174b5','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 20:50:16',NULL,NULL,'false'),(1686,'other','aceto@buffalo.edu','','Eleo ','Pomare ','dummyemail@3bc5a4ac9aadf9af9500a267e0e9f57364a0bec63093574333d332f96c21aca2c33a3112','deceased','1937-10-20','2008-08-08','Choreographer,Dancer','Prefer not to answer','male','','','','','','Santa Maria','','Colombia','','Choreographer and dancer Eleo Pomare was born on October 20 1937 in Santa Marta, Colombia. His father, Tawny Forbes, was the captain of a civilian freighter that was torpedoed near Colón, Panama during World War II. Pomare, at age six, who was with his father during the attack, survived and moved to live with his mother, Mildred Pomare Lee, in Panama. In 1947 Pomare was sent, alone, to New York City to live with an aunt and uncle who cared for him until some years later when his mother also moved to New York. He attended the New Lincoln School in Harlem, and later both P.S. #184 and James Fenimore Cooper Junior High School. At New York’s famed High School of Performing Arts, Pomare was mentored by Verita Pearson, and was exposed to such guest teachers as Uta Hagen and Martha Graham. While still a student, Pomare taught dance to other youth at the Police Athletic League (PAL). Soon, his pupils were performing at churches, schools and nearby Fort Dix. Moving into a building that housed Syvilla Fort’s studio near Town Hall, Pomare was exposed to the Durham technique by Walter Nicks and Talley Beatty. Graduating from the High School of Performing Arts in 1953, Pomare maintained his own dance company as he continued his training with Louis Horst, José Limón, Asadata Dafora, Pearl Reynolds and Curtis James. Pomare also befriended author James Baldwin, whose writing greatly influenced him.\r\n\r\nIn 1960, Pomare held his first major performance at the 92nd Street YMHA to favorable reviews. The following year he was awarded a John Hay Whitney Fellowship to study dance with Kurt Jooss in Essen, Germany. Pomare left the Jooss School and went on to reestablish the Eleo Pomare Dance Company, based in Amsterdam. He became a sensation in Europe. Using his own approach to choreography and teaching, he created his most celebrated works: Missa Luba, which combined the Catholic Mass with the music and voices of the Congolese Boys’ Choir; Blues for the Jungle, which depicted the history of African Americans from the earliest days of enslavement to the fight for equal rights in the 1960s; and Las Desenamoradas, which was inspired by Garcia Lorca’s play, The House of Bernarda Alba.\r\n\r\nOver the years, Pomare received a number of dance fellowships including the aforementioned John Hay Whitney Fellowship and a Guggenheim Fellowship in 1972. The Eleo Pomare Dance Company toured North America, Europe, Australia, Asia, the Caribbean and Africa. They also performed in Lagos, Nigeria for FESTAC ’77, the World Festival of African Arts. Some of his featured dancers include Dudley Williams, Loretta Abbott, Al Perryman, Dyane Harvey, Charles Grant, Chuck Davis, Martial Roumain, Carl Paris, Leni Wylliams and Diana Ramos. In 1986, Pomare created Morning Without Sunrise, set to music by Max Roach, in honor of the heroism of Nelson Mandela.\r\n\r\nIn 1968, Pomare, along with Carole Johnson, Rod Rodgers, Gus Solomon and Pearl Reynolds, formed the Association of Black Choreographers and THE FEET, a black dance magazine. The Eleo Pomare Dance Company celebrated twenty-five years of dance in 1983, and January 7, 1987, was declared Eleo Pomare Day by the borough president of Manhattan, David Dinkins.\r\n\r\nPomare was a highly sought after teacher and choreographer until his death on August 8, 2008, at the age of 70.','upload/photo_upload_data/1639879318picture-blank.png','',100,'31','','2021-12-18 21:11:20','2021-12-18 21:11:20','Biography: https://www.thehistorymakers.org/biography/eleo-pomare-41','false'),(1687,'other','dummyhiddenemail',NULL,'Verita ','Pearson','dummyemail@faae48eb63d71781eaa896302766c4150c3d695c106c607ce3574e93a5666b72c5e7644c','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 21:02:56',NULL,NULL,'false'),(1688,'other','dummyhiddenemail',NULL,'Uta ','Hagen','dummyemail@d7cb2d3b89b4fc9f0beb063cff5788316f92af3a89ed5fb85fbd32e2fa7cfdc64efd24a9','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 21:03:15',NULL,NULL,'false'),(1689,'other','',NULL,'Walter ','Nicks','dummyemail@b1322f8414ca7ed93be9d226389c2a51d23932cf6f2189adaa1f0464cbc5c5f8109bb394','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 21:04:02',NULL,NULL,'false'),(1690,'other','',NULL,'Talley ','Beatty','dummyemail@e9a1c6ddce8c01fb63eef3007eea9bc09c825e3569915cf2953879d90c6c3efa904ea9dc','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 21:04:18',NULL,NULL,'false'),(1691,'other','',NULL,'Louis ','Horst','dummyemail@b839565799903613a461cad6ee582d16fab04d32cf85fd8f93e0d261e4a8b5bfc5c59e73','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 21:04:45',NULL,NULL,'false'),(1692,'other','',NULL,'José ','Limón','dummyemail@3ec1802a1e810417e15b3c39f6a6b58fe0c63f630cff3880da8cd60646ebf3cae3324aa2','',NULL,NULL,'','','','','','','','','','','','','','','',0,'',NULL,'2021-12-18 21:04:59',NULL,NULL,'false'),(1693,'other','',NULL,'Asadata ','Dafora','dummyemail@20ac047c739e5ee5f93366a23611bf0b4bfe31957c6f677c27893c3865d1e9577444