ilmmaker,Visual_Artist,Other','Caucasian or White','female','','digital art','','Mount Dora','FL','','United States of America','United States of America','','Tara Lee Burns is an interdisciplinary dance artist, choreographer, and educator interested in combining dance, theater, and design making practices to re-imagine digital and analog technologies that manifest inside and outside the body. Before beginning her MFA in dance at The Ohio State University, she toured nationally with Adele Myers and Dancers for over 10 years while living in NYC and Connecticut. She has also worked with Marjani Forté, Alexandra Beller, Kelly Drummond Cawthon, and Béatrice Kombe, among others, who have inspired her interests in performing, making, and being. She received an MA in Digital performance from The University of Hull in the UK and a BFA Summa Cum Laude in Dance from The University of Florida. Tara’s work has been presented in theaters, studios, on computer screens, and on the sides of buildings. Her current research investigates the possibilities for multidisciplinary investigation and nonlinear immersion through Virtual Reality (VR) painting program, Tilt Brush and the perception of technology as prosthesis.\r\n\r\n','','',100,'5,14,22,115,30,31,117,65,78,114','','2022-01-12 20:47:59','2022-01-12 20:47:59',NULL,'false'),(1719,'other','dummyhiddenemail',NULL,'Adele','Myers','dummyemail@82627a35a297c9e0a467da272bc84b87d5671094b47d315e8044ee0cfbb66548f3821225','',NULL,NULL,'','','','','','','','','','','','','','','www.adelemyersanddancers.com',0,',31',NULL,'2022-01-12 20:47:32',NULL,NULL,'false'),(1720,'artist','stanleylawson99@gmail.com','','Stanley','Lawson','stanleylawson99@gmail.com','living','1996-10-11',NULL,'Visual_Artist,Other','','','','Writer','','','','','','','','<p><a href=\"https://puffshaven.com/\">Puff Dispensary</a> is a Toronto-based medical cannabis dispensary with over 40 different strains of cannabis. They also have edibles and concentrates, as well as a f