INSERT INTO `bugs` VALUES (30,'','2019-11-12 10:33:50','0','aceto@buffalo.edu','Melatest','Thank you for making a HELP Section.','I am testing the test site','New Feature','3 - Low',NULL),(31,'','2019-11-12 10:34:43','0','aceto@buffalo.edu','Melatest','I like the fact that I can use the HELP section without logging in as anyone. - or before logging in.\r\n','Help site',NULL,'4 -',NULL),(33,'','2019-11-12 16:45:08','0','aceto@buffalo.edu','Melanie','Please change the admin credentials from Yogesh to:\r\nUN:  choreographiclineage@gmail.com\r\nPW:  cl@buffalo','change Admin credentials','Enhancement','3 - Low',NULL),(34,'','2019-11-12 16:46:00','0','aceto@buffalo.edu','Melanie','When you google Choreographic Lineage - then hit the link that shows up on Google - it goes to the site, but at the top bar (where the website address is) is says:\r\n â€œNot Secure -choreographiclineage.buffalo.eduâ€\r\nHow can we get a secure site?\r\n','Secure Site','','1 - High','omkarsun@buffalo.edu'),(35,'','2019-11-12 16:49:22','0','aceto@buffalo.edu','Melanie','There is no HELP button on the explore the network section.\r\n','Help in Network','','4 -',NULL),(36,'','2019-11-12 16:56:22','1','aceto@buffalo.edu','Melanie','There isnâ€™t a â€œtitleâ€ field for entering names. I have to include â€œDr.â€ in the first name field. (Kate)\r\n[SARANG] This will have an  impact on several forms currently and I estimate that it will take more time.  Do we need to address this right now as it is more related to convenience. \r\n[Melanie] we can hold off 11/4/19\r\n','Title field','Enhancement','4 -',NULL),(37,'','2019-11-12 16:59:50','1','aceto@buffalo.edu','melanie','Confused what searching is supposed to do on explore the network. I type in a name, it goes blank for a second, shows: â€œresults for dr. Hudson hornetâ€ at top line but then just has my regular network showing. It doesnâ€™t go to the profile I search for or zoom in or anything. (Kate)\r\n[SARANG] It does behave slow sometimes, but then it Zooms into the profile. I am guessing it might be a cache o','Visualization: Search','','4 -',NULL),(38,'','2019-11-12 17:01:33','1','aceto@buffalo.edu','Melanie','The cursor on explore the network is incredibly fickle. I donâ€™t know if itâ€™s just that my computer is slow or what, but sometimes itâ€™ll hover over and display the name of the circle and sometimes it wonâ€™t.Sometimes it is the hand/glove and sometimes itâ€™s an arrow. No idea how to switch back and forth. (Kate)\r\n[SARANG] Did you use Chrome ? we made some improvements on Network Page but due','Visualization: Explore the Network','','4 -',NULL),(39,'','2019-11-12 17:03:58','0','aceto@buffalo.edu','Melanie','Log In issue:  if a user signs up for an account and leaves the website page (Closes his computer, letâ€™s say) and comes back later to enter in the password that was sent to him, it doesnâ€™t work.  He had to do â€œforgot Passwordâ€ and have another password sent - while the login page was open.  - Page expiring function that is common. \r\nCan we include a note somewhere that indicates the passwo','Password setting','','4 -',NULL),(40,'aceto@buffalo.edu-Menu Bar disappearing-Screen Shot 2019-11-12 at 10.40.37 AM.png','2019-11-12 17:04:57','0','aceto@buffalo.edu','melanie','Look what happens to the menu bar once I submit a request for a phone appt:\r\n','Menu Bar disappearing','Bug','2 - Moderate',NULL),(41,'aceto@buffalo.edu-Menu Bar disappearing-Screen Shot 2019-11-12 at 10.43.26 AM.png','2019-11-12 17:05:35','0','aceto@buffalo.edu','melanie','This is what happens to the menu display after I enter my new password (I just joined the network).\r\n','Menu Bar disappearing','Bug','2 - Moderate',NULL),(42,'','2019-11-12 17:06:26','0','aceto@buffalo.edu','aceto',' Genre isnâ€™t working like it used to.  I canâ€™t see what Iâ€™ve chosen.  Take a look at the active site. It should still be there, no?  \r\nI should be able to choose all that apply (Profile Page:  Please add â€œchoose all that applyâ€ in small letters under  â€œgenreâ€.) and I should see a list of all genres that I chose.\r\n\r\n','\"Genre\" function ','','4 -',NULL),(43,'','2019-11-12 17:07:46','0','aceto@buffalo.edu','melanie','There used to be Modern/Contemporary.  I only see Contemporary/Modern.\r\nPlease add \"Modern/Contemporary\" as well. How will this work when we go to search?  How can it be an \"and/or\"?  People use different terms depending on where they are from. \r\n','Genre: Modern/Contemporary','','4 -',NULL),(44,'','2019-11-12 17:08:23','0','aceto@buffalo.edu','Melanie','EDUCATION\r\nA.)Only 3 SUNY colleges come up (pre-populate) under Universities/Education.  Why?  \r\nThere are like 25.\r\nhttps://www.suny.edu/attend/visit-us/complete-campus-list/\r\n','Education:  SUNY list','','4 -',NULL),(45,'','2019-11-12 17:08:52','1','aceto@buffalo.edu','melanie',' How are we accounting for uniformity in entering degreesâ€¦.so that they are some day searchable.  I can enter MFA or Master of Fine Arts.  How can we pre-populate degrees?  Should we? \r\n','Degree Uniformity','','3 - Low',NULL),(46,'aceto@buffalo.edu-ABOUT LINEAGE page not showing up going forward-Screen Shot 2019-11-12 at 11.50.49 AM.png','2019-11-12 17:09:49','0','aceto@buffalo.edu','Melanie','ABOUT LINEAGE:\r\nIâ€™m using Chrome and I STILL never get the about lineage page (screenshot below).  I hit save and continue after submitting my photo and am taken to the â€œenter your lineageâ€ page.  If I hit the Previous button on Enter Your Lineage page is the only way I access the ABOUT LINEAGE page.\r\n','ABOUT LINEAGE page not showing up going forward','','4 -',NULL),(47,'aceto@buffalo.edu-Save and come back later-Screen Shot 2019-11-12 at 11.56.11 AM.png','2019-11-12 17:10:36','0','aceto@buffalo.edu','Melanie',' I was on the Add LIneage page and I hit SAVE AND COME BACK laterâ€¦..a pop-up asking me to accept terms and conditions in order to submit (!) came up.  I did not hit â€œsubmitâ€.   This popup should not appear for SaveAndComeBackLater. \r\n','Save and come back later','','1 - High','aceto@buffalo.edu'),(48,'','2019-11-12 17:49:32','0','aceto@buffalo.edu','Melanie','HELP Page:  once you submit a message, the â€œSomeone will get back to youâ€¦â€ needs a period at the end of the sentence.\r\n','Help Page','Enhancement','3 - Low',NULL),(49,'','2019-11-12 17:50:28','0','aceto@buffalo.edu','Melanie','Please add â€œdance filmâ€, â€œSomaticsâ€ â€œLightingâ€ to the genre list\r\n','Genre additions','Enhancement','3 - Low',NULL),(50,'aceto@buffalo.edu-Gender Mandate-Screen Shot 2019-11-12 at 11.12.26 AM.png','2019-11-12 17:53:12','0','aceto@buffalo.edu','Melanie','Gender: we cannot mandate that users share their gender. \r\nPlease take out this mandate.  \r\nChange â€œgenderâ€ to â€œgender identityâ€.\r\nTake out â€œOtherâ€ and use â€œPrefer not to discloseâ€ (donâ€™t include â€œDecline to answerâ€ as listed below).\r\nAdd the following choices:\r\n','Gender Mandate','Enhancement','1 - High','aceto@buffalo.edu'),(51,'aceto@buffalo.edu-Phone appt. request-Screen Shot 2019-11-12 at 10.45.39 AM.png','2019-11-12 18:01:09','0','aceto@buffalo.edu','Melanie','The message that we send when someone requests a phone appointment (See screenshot) should include our phone and email address below â€œchoreographic lineage teamâ€.\r\n','Phone appt. request','','4 -',NULL),(52,'','2019-11-12 18:01:49','0','aceto@buffalo.edu','Melanie','Can the fonts for â€œHi, Melanieâ€ and â€œLog outâ€ be smaller?   It still looks like a main menu choice.\r\n','Log Out font Size','Enhancement','3 - Low',NULL),(53,'','2019-11-12 18:02:17','0','aceto@buffalo.edu','Melanie','Profile Page:  Please add â€œchoose all that applyâ€ in small letters under  â€œgenreâ€.\r\n','Genre choices','','1 - High','sarangag@buffalo.edu'),(54,'','2019-11-12 18:06:28','0','aceto@buffalo.edu','Melanie','\"Password Set Successfully!\" Page:  Change â€œcontributeâ€ to â€œshareâ€. \r\n','Password set page','','4 -',NULL),(55,'','2019-11-12 18:06:55','0','aceto@buffalo.edu','Melanie','need ability to enter in â€œotherâ€ in Genre for lineage. Example: I collaborated with an Architect, but there is no way for me to be able to notate that.\r\n','Genre/Other','','1 - High','sarangag@buffalo.edu'),(56,'','2019-11-12 18:08:43','0','aceto@buffalo.edu','Melanie','There is no STATE field  in â€œCurrent Residenceâ€!?!  Please add. Was there a reason we took that out?  What about international addresses?  Does this form accommodate international addresses?  \r\n','State field','','1 - High',NULL),(57,'','2019-11-12 18:11:43','0','aceto@buffalo.edu','Melanie','BIOGRAPHY:  â€œChoose Fileâ€ and â€œUploadâ€ buttons should be side by side. They should be different colors.  They may not even see that they have to â€œuploadâ€.  Buttons can be smaller.\r\nWhat existing model can we use for Visually Displaying â€œChoosing a fileâ€ and â€œUploading itâ€? That seems like it is a common function that would have some precedent.  \r\n','Biography buttons','','1 - High','mantriyash0007@gmail.com'),(58,'','2019-11-12 18:12:15','0','aceto@buffalo.edu','Melanie','Update ABOUT Page:\r\na.) take out Stacy Snyder\r\nb.)  Add in Alan Hunt  (get bio and headshot from him)\r\n','ABOUT page UPDATE','','4 -',NULL),(59,'','2019-11-12 18:14:34','0','aceto@buffalo.edu','Melanie','Home page: \r\nadd a â€œContribute my lineageâ€ button/link in the first paragraph at the end of the last sentence.\r\n','Home Page: additional link needed','Enhancement','3 - Low',NULL),(60,'','2019-11-12 18:26:03','0','aceto@buffalo.edu','Melanie','Under CONTACT on homepage, take out the word â€œIDâ€ next to â€œemail IDâ€.\r\n','email ID','','4 -',NULL),(61,'','2019-11-12 18:35:51','0','aceto@buffalo.edu','Melanie','The â€œcontinue laterâ€ button needs to say â€œsave and continue laterâ€ so the user is assured her lineage is saved:) \r\n','Continue Later','','2 - Moderate',NULL),(62,'','2019-11-12 18:40:35','0','aceto@buffalo.edu','Melanie','New User Path: If someone listed Jane Smith in their lineage, when Jane Smith goes to make a profile, it should prompt her with the spelling of her name.\r\nAdding Lineage for yourself:  same as above\r\nAdding lineage for someone else: Same as above above:)\r\n\r\n','Type Ahead Function','Enhancement','1 - High','aceto@buffalo.edu'),(63,'','2019-11-12 22:45:23','0','aceto@buffalo.edu','Melanie','When putting in information, there is no option for a second degree or major from the same University.  Please add that capability. \r\n','Second College Degree Earned','','4 -',NULL),(64,'','2019-11-12 22:46:32','0','aceto@buffalo.edu','Melanie','Why do we have â€œyou are in artist_add modeâ€ on the Profile page?','Mode?','','3 - Low',NULL),(65,'','2019-11-12 22:48:26','0','aceto@buffalo.edu','Melanie','can you please share the workflow document with me in the fall2019 google folder?  Thanks!\r\n','Work Flow Document','','3 - Low',NULL),(66,'','2019-11-12 23:21:03','0','aceto@buffalo.edu','melanie','There is a mysterious black question mark on the visualization page underneath LOGIN.  What is that? I think it should be removed, no?','?','','4 -',NULL),(67,'','2019-11-12 23:22:24','0','aceto@buffalo.edu','Melanie S. Aceto','can you apply the same gender menu that I previously sent to the visualization page search criteria? Right now there is just Male and Female as options.','Gender again','','1 - High',NULL),(68,'','2019-11-13 09:49:07','0','aceto@buffalo.edu','Melanie','I received an email stating that my issue has been resolved:  \"Hi Melanie,\r\nThe status of the bug you reported has been updated. \r\nThe following comment was added by the admin. Please reply to this mail accordingly.\r\nComment :Issue Resolved\"\r\n***I have no idea what my issue was!  Can we include the original text (original issue/bug)  in our communication email with the person who reported it? ','Bug Notification',NULL,'4 -',NULL),(69,'','2019-11-18 09:50:28','0','choreographiclineage@gmail.com','Choreographic Lineage','Please title each page\'s content \"Unresolved Bugs\" \"Resolved Bugs\"\r\nMake the \"view resolved/unresolved bugs\" button smaller and maybe below the title you are adding.  The title of the page should be the main idea.  The \"view the other\" should be secondary. Thanks!','Administrator\'s Bug Page','','3 - Low','omkarsun@buffalo.edu'),(70,'','2019-11-18 09:51:56','0','choreographiclineage@gmail.com','Choreographic Lineage','I can log on as an administrator under the TWO below credentials.  Please limit it just to the gmail one.\r\naceto@buffalo.edu  (PW:  testpassword)\r\nchoreographiclineage@gmail.com (PW:  cl@buffalo)\r\n','Administrator\'s Credentials','','3 - Low',NULL),(71,'msaceto2@gmail.com-Menu bar is wonky-Screen Shot 2019-11-18 at 2.06.46 PM.png','2019-11-18 14:05:59','0','msaceto2@gmail.com','Tuesdaytest November','see screenshot.  I\'m using Chrome. This has never happened before and now is constantly the case.','Menu bar is wonky','Bug','1 - High',NULL),(72,'msaceto2@gmail.com-Genre Navigation on Lineage Page-Screen Shot 2019-11-18 at 2.16.55 PM.png','2019-11-18 14:15:53','0','msaceto2@gmail.com','Tuesdaytest November','This navigation is not intuitive. You can type to search your first genre and your choice is visible. However, it isn\'t obvious/clear how to enter multiple Genres.  That invisible \"x\" to clear the search is not intuitive - it is invisible. As well,  it isn\'t really clear that that box is a SEARCH box.  How can we make the Search Box look like a search box and how can we make it visibly obvious/cle','Genre Navigation on Lineage Page','Enhancement','1 - High',NULL),(73,'','2019-11-18 14:17:47','0','msaceto2@gmail.com','Tuesdaytest November','We are taking out ability to enter an email address for someone in your lineage.  We don\'t want to ask our contributors for others\' information.\r\nthanks.\r\n','CHANGE: Lineal  Email Address','Enhancement','1 - High','vaidehia@buffalo.edu'),(74,'msaceto2@gmail.com-? roll-over (second try)-Screen Shot 2019-11-18 at 2.23.06 PM.png','2019-11-18 14:26:44','0','msaceto2@gmail.com','Tuesdaytest November','The \"?\" next to the lineal relationships do nothing when you click them.  This must be the same issue for the other \"?\" issue I had. \r\nIt is not intuitive to wait patiently for the roll-over. I want to click. Is it possible to be able to CLICK on a \"?\" for information? \r\nOr the roll-over has to be immediate. \r\nAs well, clicking on it seems to negate the roll-over capability. \r\n\r\n ','? roll-over (second try)','Bug','1 - High','aceto@buffalo.edu'),(75,'msaceto2@gmail.com-Titles of works-Screen Shot 2019-11-18 at 2.36.03 PM.png','2019-11-18 14:35:46','0','msaceto2@gmail.com','Tuesdaytest November','Please add (separate multiple title with a comma) after \"please list the titles...\". \r\nPlease also add a period at the end of that sentence, before the parenthesis.\r\n','Titles of works','Enhancement','1 - High',NULL),(76,'msaceto2@gmail.com-Save and Add another artist-Screen Shot 2019-11-18 at 2.38.08 PM.png','2019-11-18 14:37:31','0','msaceto2@gmail.com','Tuesdaytest November','When I click \"Save and add another artist\" on the Lineage page, nothing happens!  The data doesn\'t go away. The name does not get listed in the list below. nothing happens!?!?!?\r\nI am in CHROME','Save and Add another artist','Bug','1 - High','vaidehia@buffalo.edu'),(77,'','2019-11-18 14:48:21','0','msaceto2@gmail.com','Tuesdaytest November','I added lineage to the profile with the first name: Tuesdaytest and Last name: November for my msaceto2@gmail.com email address.  After I hit SUBMIT my lineage and went back to my profile it listed 2 \"OTHer\" artists profiles under my profile for which I did not submit.  I think those are ones Kate entered.  How did this happen?  \"Art Form\" and \"Articulate You\" are not artists I entered.\r\nI am unab','Wonky identity/Crossed lineage','Bug','1 - High','choreographiclineage@gmail.com'),(78,'','2019-11-18 14:53:44','0','aceto@buffalo.edu','Melanie','1. I was logged in at msaceto2@gmail.com and deleted the user \"Art Form\", one of the \"Other Artists\" listed on my page (for some strange reason). When I hit delete, it completely logged me out. I don\'t think it should log a person out. It should provide a confirmation that this artist has been deleted, but keep you logged in.  I don\'t want to take users away from the site. \r\n2. Can you check to se','Deleting an artst ','Bug','2 - Moderate',NULL),(79,'','2019-11-18 21:45:11','0','omkarsun@buffalo.edu','Omkar Thorat','this is test','Development Server Test ',NULL,'4 -',NULL),(80,'','2019-11-22 22:58:17','0','choreographiclineage@gmail.com','Choreographic Lineage','I was on Personal Information/Education Information page, filled out my personal information then hit \"continue Later\" and when I came back, my information wasn\'t saved!  \"Continue Later\" needs to SAVE and continue later. The button needs to say \"Save and Continue Later\" and it actually needs to save.','Continue Later not saving','','2 - Moderate',NULL),(81,'','2019-11-29 17:24:26','1','mehulawa@buffalo.edu','Mehul  Awasthi','Would be great to have a newsfeed feature similar to Instagram/Facebook.','New newsfeed feature','New Feature','4 -','yogeshja@buffalo.edu'),(82,'','2019-12-01 16:29:26','0','aceto@buffalo.edu','Melanie','Did you ever expand the number of characters allowed in this Description box in HELP/Bug report system?  Dr. Hunt made a recommendation as to how to expand the size of the text box. ','Help Text Box','','4 -','omkarsun@buffalo.edu'),(83,'msaceto2@gmail.com-Linking Artists-Screen Shot 2019-12-01 at 4.32.55 PM.png','2019-12-01 16:36:17','0','msaceto2@gmail.com','Tuesdaytest November','I added Mickey Mouse to my lineage. It prompted me to \"link\" the already existing Mickey Mouse record by Alan Hunt. I clicked \"link\" and it is stuck on \"Loading\". See screenshot.\r\n','Linking Artists','Bug','1 - High',NULL),(84,'','2019-12-01 16:39:22','0','msaceto2@gmail.com','Tuesdaytest November','We need to add \"Improvisation\" to the both Genre fields (the one in Your Profile - it may already be there, I can\'t recall) and the one where you add your Lineal Artists.\r\nI see \"Contact Improvisation\", but we need \"Improvisation\" as well.\r\n','GENRE: Add Improvisation ','Enhancement','1 - High',NULL),(85,'','2019-12-02 19:43:00','1','mikipadh@buffalo.edu','Miki Padhiary','Unable to add an event','Bug regarding event handling','Bug','4 -',NULL),(86,'','2019-12-02 22:50:04','1','msaceto2@gmail.com','Tuesdaytest November','It seems as if I can continue to Notify my contacts about the same event by mistake. I hit \"notify contacts\", I get a confirmation message, but then I am still able to continue to click that button.  ONce I notify contacts, the button should no longer be clickable, yes?\r\n\r\n','Notify Contacts','Enhancement','2 - Moderate',NULL),(87,'','2019-12-02 23:08:38','0','melanieaceto@yahoo.com','Melanie Aceto','I think the reason I don\'t know that the status bar is a status bar is because the circles don\'t change to notate location.  It should fill in with light green or something to denote which part you are on. ','Status Bar Notation','Enhancement','3 - Low','choreographiclineage@gmail.com'),(88,'','2019-12-02 23:17:42','0','melanieaceto@yahoo.com','Melanie Aceto','Once you choose Add a File for Biography... you can\'t delete it. You can choose another and it will override the first one, but I think we should be able to \"un choose\" a file we chose and simply copy and paste if wanted. ','Biography File: Can\'t delete file','Enhancement','1 - High','mantriyash0007@gmail.com'),(89,'','2019-12-02 23:30:03','0','melanieaceto@yahoo.com','Melanie Aceto','I joined the network as a NEW user under Melanie Aceto in the STARK test site. I created a new account with a new password.  I was going through the form as a new user.  Once I listed Monica Barnes in my lineage, it asked me to Link to the existing Monica Barnes.  Once I did, ALL of my lineage that I had put in in the past populated in a list below!  How come it didn\'t recognize me as having already existed in the site previously? ','Populated my Lineage???','','1 - High','aceto@buffalo.edu'),(90,'melanieaceto@yahoo.com-Linked Profile Prompt Window-Screen Shot 2019-12-02 at 11.30.47 PM.png','2019-12-02 23:35:45','0','melanieaceto@yahoo.com','Melanie Aceto','The design of the window that asks you to link to an existing artist is not clear.  \r\n1. What is the \"NONE\" button doing up there? \r\n2. The phrase \"Profiles with the given name exist. Click...\" should be located over the list of names to choose from.\r\n3. Change that phrase to read \"A profile with that name already exists.  Click the name below to view it\'s details and confirm that this is the person you are referring to.\"','Linked Profile Prompt Window','Enhancement','1 - High','aceto@buffalo.edu'),(91,'melanieaceto@yahoo.com-Clear Form-Screen Shot 2019-12-02 at 11.37.28 PM.png','2019-12-02 23:38:04','0','melanieaceto@yahoo.com','Melanie Aceto','On the linage page, the button should read \"Clear fields\", not \"clear form\".  I would be afraid of losing all of my lineage listed below!\r\n','Clear Form','Enhancement','1 - High',NULL),(92,'melanieaceto@yahoo.com-Stuck on LOADING-Screen Shot 2019-12-02 at 11.41.46 PM.png','2019-12-02 23:43:04','0','melanieaceto@yahoo.com','Melanie Aceto','In Another ARtist\'s Lineage thread, I clicked Save and Add another and it is stuck on LOADING.... \r\nIt hasn\'t listed the name that I just entered in the list below. ','Stuck on LOADING','Bug','2 - Moderate',NULL),(93,'melanieaceto@yahoo.com-Save and continue Later-Screen Shot 2019-12-02 at 11.44.50 PM.png','2019-12-02 23:46:37','0','melanieaceto@yahoo.com','Melanie Aceto','There still exists the issue of when on the Lineage Contribution page, I hit SAVE AND CONTINUE LATER... it prompts me to Accept the Terms and Conditions to Submit.  I don\'t want to submit. I want to save and come back later.','Save and continue Later','Bug','1 - High','aceto@buffalo.edu'),(94,'','2019-12-05 15:10:33','0','omkarsun@buffalo.edu','Omkar ','test','Test issue before demo day','New Feature','3 - Low','omkarsun@buffalo.edu'),(95,'omkarthorat21@gmail.com-Development Server Test -Screenshot (40).png','2019-12-06 10:04:01','0','omkarthorat21@gmail.com','OMKAR SUNIL THORAT','test','Development Server Test ','New Feature','2 - Moderate','omkarsun@buffalo.edu'),(96,'','2020-02-21 13:34:42','0','aceto@buffalo.edu','Melanie Aceto','In the ABOUT LINEAGE page, please change \"Influenced by\" to read:  People with whom you have NOT studied, danced or collaborated, but who have significantly influenced your work such as other artists, authors, theorists, etc.  You do not need to have a relationship with this person in order to list them as having an impact on  your work. \r\nPlease also update this definition on the \"Enter your Lineage\" page in the tiny black \"?\" near \"Influenced by\".  ','Influenced By definition change','','1 - High',NULL),(97,'','2020-02-21 13:37:49','1','aceto@buffalo.edu','Melanie Aceto','There should be the ability to add an attachment to a Bug that has already been listed/logged/entered.  Right now, you can  only attach a screenshot/attachment when you first post the BUG.  I\'d like to be able to post an attachment after the Bug has been listed... in the ongoing conversation of fixing the bug.','Attachment capability in Admin Bug Reporting','New Feature','3 - Low',NULL),(98,'','2020-02-22 17:55:29','0','lauraneese@rocketmail.com','Laura Neese','difficulty logging in/ changing passwords.\r\n\r\nAfter I enter the temporary reset code and new password - can\'t login.','login','Bug','2 - Moderate','aceto@buffalo.edu'),(99,'','2020-02-23 08:32:59','0','jpf2@buffalo.edu','Jeanne Fornarola','Created a new account. used the one time password. created a new password. can\'t log in. it goes nowhere'